(25, 1, 'Joining The Day We Fight Back', 'https://drupal.org/node/2188053', 'Crell', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>Free Software is not just about saving money.  It''s not just about sharing for sharing''s sake.  Free Software, at its core, is about empowering people.  It is about ensuring that everyone has ultimate control over their own electronic lives, because the software that runs their electronic lives is under their control and not someone else''s.</p>\n<p>How do you know your computer is doing what you tell it to, and not someone else?  How do you know your phone is only recording what you tell it to record?  How do you know your files are only being read by you?  How do you know your refrigerator isn''t reporting on your diet to someone else?</p>\n<p>The only way to be sure is to have the source code so that you or someone you trust can verify that it is doing only what you tell it to and your electronic tools are not secretly acting for someone else.  Free Software is all about ensuring an individual''s personal digital sovereignty, free from unwanted or secret invasion from anyone -- other people, corporations, or governments.</p>\n<p>The entire point of sharing source code is so that individual people and organizations can ultimately have control over their own equipment, information, and digital lives. In many ways it is about privacy: The security to know that your data is accessible to you, and your computer is used by you, and only you, unless you decide otherwise.</p>\n<p>Recent revelations, however, have shown that people''s digital sovereignty is under even more attack than before.  Both the American and British governments have been found violating the digital privacy of millions of people in their own countries and around the world.  That is exactly the sort of attack on individual digital sovereignty that Free Software was created to combat.</p>\n<p>As a leading Free Software project, the Drupal Community opposes such privacy invasions.  We believe it is our ethical duty to stand with <a href="https://thedaywefightback.org/" rel="nofollow">The Day We Fight Back</a> and others who oppose such violations of individual digital sovereignty.  We encourage all people, all over the world, to take a stand for digital freedom.  If you are in the United States you can use the banner at the bottom of this page to locate and contact your Congressional representatives and tell them to oppose further infringement of individual privacy rights and to force the NSA and similar agencies to obey the law in both letter and spirit.</p>\n</div></div></div>', 1392074413, '2188053 at https://drupal.org'),
(26, 1, 'Community Spotlight: Lee Rowlands (larowlan)', 'https://drupal.org/node/2217905', 'leighc', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p><img class="right" src="/files/leerowlands_0.png" alt="Lee Rowlands" />Since joining Drupal.org in 2007, Lee Rowlands (<a href="https://drupal.org/user/395439" rel="nofollow">larowlan</a>) has been an important contributor to the Drupal project. A major core contributor and Drupal 8 advocate, Rowlands has become a well-recognized and celebrated member of the Drupal community. </p>\n<p>Rowlands is an important Drupal figure in Australia, and has spoken at DrupalCamp Brisbane 2010, Drupal Downunder Melbourne 2012, DrupalCon Sydney 2013 and Drupal South Wellington 2014. An occasional mentor during Drupal Office Hours in the Australian timezone (GMT+10), Rowlands is also a well-recognized figure in the international Drupal community for his involvement with core and his contributions to a huge variety of projects on Drupal.org.</p>\n<h3>How did you get involved with Drupal?</h3>\n<p>Jim Morrison and a naked native american came to me in a dream and told me it was my destiny. Just kidding. I started up my own IT consulting business and I''d built a couple of Drupal 5 sites. </p>\n<p>The third site I built needed some tricky mapping functionality. This was in Drupal 5 and the site was for a locally owned fishing tackle franchise. Their point of difference with the big national chain-store was local knowledge. So they had this great idea to create a series of online fishing maps for local regions, each featuring points of interest for that region. Each point of interest had a marker icon based on its type, eg there were boat ramps, fishing spots etc. Each marker had a popup with an image and some text. The kind of thing you can build on your own with Google Maps now, but back then - it was a fairly new concept. </p>\n<p>At the time gmap module was the go-to mapping option (Drupal 5) but it didn''t support the image/marker/description functionality. So I wrote a patch to allow wiring up a content-type with gmap functionality to do so. And in order to post the patch, I had to sign up for a Drupal.org account. So that was my first comment on Drupal.org, a sizeable patch!</p>\n<p>Not long after that I pitched the idea of a website to a local motel that had just had a renovation. At this stage Drupal 6 was out and the go-to ecommerce solution was Ubercart. My pitch included online-reservations so I worked with Will Vincent to round out a hotel-booking solution for Ubercart. That''s how I got my CVS access on Drupal.org. </p>\n<p>Contributing my code back to Drupal.org opened my consulting business up to the world. Up until that point most of my work had been for local businesses. Once I had a project on Drupal.org I started receiving work offers via my Drupal.org project page, mostly for adding new pieces of functionality.</p>\n<p>I continued building sites and I always ensured that I had contract provisions to open-source any generic modules that the project needed. Over time I ended up with more than 30 contrib projects on Drupal.org, all with varying degrees of maintenance. Each of these kept resulting in work referrals and I kept expanding my skillset and client-base.</p>\n<p>Then Drupal 7 came out and it felt like I had to start learning all over again. I had a long car-trip coming up so I downloaded the mega ''Upgrading 6.x modules to 7.x'' thread from Drupal.org and spent about three hours taking in all the changes. As soon as I had net access, I subscribed to the Drupal core issues RSS feed. At this stage my motivation was just to keep across changes happening in core, but after a while I started seeing issues posted that I realised I could fix/work on. So I started commenting and posting the odd patch. </p>\n<p>Not long after an epic thread was posted by @sun in the issue queue titled ''Make core maintainable'' (<a href="https://drupal.org/node/1255674">https://drupal.org/node/1255674</a>), basically it was proposing that if we didn''t get more hands on deck in core, the only way forward was to start dropping unmaintained modules. I jumped into irc and put my hand up to maintain forum, one of the modules on the chopping block. I had a conversation with @chx who later remarked ''yesterday I saw a guy on IRC who was contemplating on taking the forum module maintainer hat'' (<a href="http://www.drupal4hu.com/node/303">http://www.drupal4hu.com/node/303</a>). </p>\n<p>So from there I took a more active role in core contribution. Those threads are a great read, even today, as they indicates the level of frustration that core developers were experiencing in the first six months of Drupal 7''s release. </p>\n<h3>What do you do with Drupal these days?</h3>\n<p>I build sites for some of Australia''s largest government, education, media and non-profit organisations with one of Australia''s most respected Drupal Agencies, PreviousNext. It''s a great team and I get to work on interesting projects. </p>\n<p>After all this time I still enjoy working with Drupal. Sometimes people lament Drupal''s ease of site-building, likening it to ''golden handcuffs'', but that''s where contributing to core and contrib help. If you find yourself stuck in a ''click-monkey'' rut, contributing code lets you flex your ''code-monkey'' muscles.</p>\n<h3>You’re involved with quite a variety of projects in the Drupal community  - can you describe some of the things you do and why you like them?</h3>\n<p>I particularly like working on Drupal core because it helps me keep abreast of upcoming changes. I don''t have a CS education, I have degrees in mathematics and engineering, and I''ve been quoted before saying I got my CS education in the Drupal issue queues. As a contributor you are incredibly lucky to have your work constructively reviewed by some of the world''s best programmers. Every time someone makes a suggestion on your patch, you learn a little more. I''ve learnt so many programming concepts from reviewing other''s code and having my code reviewed by others. Particularly during the Drupal 8 cycle, where we''ve effectively rewritten Drupal in a new language - PHP 5.3.</p>\n<h3>What’s the coolest project you’ve worked on?</h3>\n<p>Its not live anymore unfortunately but I worked on sendmypostcards.com which was a Drupal 6 site with Ubercart where you could create your own postcards and pay to have them printed. You could use your Facebook photo-galleries, Flickr account or upload your own files. The designer/editor was built with jQuery and the site used batch-jobs to generate 300dpi print-ready PDFs. It was a challenging project but it did end up spawning a number of contrib modules including Image Cache External which allows you to generate derivatives of remote images. Unfortunately the site didn''t last, but I did get a couple of Christmas cards printed and sent to my office. It was great to have something tangible, I still have them mounted on my office wall.</p>\n<h3>What changes do you hope will come in Drupal 8?</h3>\n<p>I''m disappointed we didn''t get a layout builder in core but I''m excited by the opportunities for it to develop and mature in the contrib ecosystem. Some of the work done as part of the Scotch Initiative by @sdboyer and @eclipsegc was pretty awesome. @sdboyer stepped me through the ''Princess'' branch (the name was a dare) at the stage when it was fairly functional and the possibilities it opened up were pretty awesome. Hopefully that work will be leveraged for what becomes of panels/page manager in Drupal 8.</p>\n<h3>What is your favorite part about the Drupal community?</h3>\n<p>Getting to work with insanely intelligent and brilliant people. There are so many awesome people working with and on Drupal every day who are always willing to share their experiences and knowledge.</p>\n<h3>Tell us a little about your background or things that interest you outside Drupal?</h3>\n<p>I live in Central Queensland at the Southern tip of Australia''s Great Barrier Reef. We have three World Heritage listed destinations all within our reach - the reef, Fraser Island and Mon Repos Turtle Rookery, where you can watch Marine turtles lay their eggs or the hatchlings make their way into the world. The climate is great, the cost of living is low and the people are some of the friendliest in the world. I get to work out of an office with two great Drupal devs who also work for PreviousNext, @nick_schuch and @grom385. Its a great lifestyle, our office is right on the beach.</p>\n<p>Outside Drupal I''m passionate about family, with two school aged children and I''ve been married for 15 years. I''m lucky that Drupal gave me an income while my children were pre-school aged and when they went off to school I was able to turn this into a career.</p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/20236">Drupal 8.x</a></div></div></div>', 1394808302, '2217905 at https://drupal.org'),
(27, 1, 'Drupal.org Response to Heartbleed Security Incident', 'https://drupal.org/news/2014-04-08-security-update', 'joshuami', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>You may have heard that a vulnerability in the OpenSSL cryptographic library called Heartbleed or formally called CVE-2014-0160 has been disclosed and that it represents a potential security threat to a large number of websites. Using this vulnerability, malicious individuals could access sensitive information submitted by people actively visiting a website including usernames, passwords and credit card numbers. Users across the Internet should be especially aware of suspicious activity on their accounts.</p>\n<p>We want to communicate a couple pieces of information about this news with regard to Drupal.org. </p>\n<p>Members of the Drupal Association staff, Drupal Security Team and Drupal Infrastructure Team have reviewed Drupal.org''s potential exposure to the vulnerability. </p>\n<p>As of now, we have no indication that Drupal.org was attacked using this vulnerabililty. That said, the nature of the vulnerability makes an attack difficult to detect and we prefer to be cautious. </p>\n<p>We have taken steps to protect users of Drupal.org, including a forced password reset for users with administrative access or access to code repositories for projects. While we have only forced the password reset for some users, we recommend that all of our users change their passwords.</p>\n<p>We have taken the following steps to protect Drupal.org account holders:</p>\n<ul><li>Installed new SSL certificates based on a new private key</li>\n<li>Revoked the old SSL certificates</li>\n<li>Replaced the private strings (drupal_private_key and drupal_hash_salt) which are used for a variety of security related purposes in all Drupal sites</li>\n<li>Replaced the private key used by the “bakery” single-sign-on system on Drupal.org</li>\n<li>Removed all active sessions</li>\n<li>Verified the email addresses in use today match those in use a week ago</li>\n<li><strong>Required that all Drupal.org users with administrative or project repository access to reset their passwords</strong></li>\n</ul><p>Also, we simply want to help create awareness about the vulnerability and encourage people to review their sites for exposure. For more information, please see <a href="https://web.nvd.nist.gov/view/vuln/detail?vulnId=CVE-2014-0160">https://web.nvd.nist.gov/view/vuln/detail?vulnId=CVE-2014-0160</a></p>\n<p>Feel free to comment on the post with any questions. Thank you!</p>\n</div></div></div>', 1396996574, '2236343 at https://drupal.org'),
(28, 1, 'Drupal 7.27 and 6.31 released', 'https://drupal.org/drupal-7.27', 'David_Rothstein', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p style="position: inherit;"><em>Update: <a href="/drupal-7.28">Drupal 7.28</a> is now available.</em></p>\n<p style="position: inherit;">Drupal 7.27 and Drupal 6.31, maintenance releases which contain fixes for <strong>security vulnerabilities</strong>, are now available for download. See the <a href="http://drupal.org/drupal-7.27-release-notes">Drupal 7.27</a> and <a href="http://drupal.org/drupal-6.31-release-notes">Drupal 6.31</a> release notes for further information.</p>\n<div style="float: right; margin: 0 0 1em 1em; text-align: center;">\n<a href="http://ftp.drupal.org/files/projects/drupal-7.27.tar.gz" class="link-button" style="margin: 0 0 0.6em 0;"><span>Download Drupal 7.27</span></a><br /><a href="http://ftp.drupal.org/files/projects/drupal-6.31.tar.gz" class="link-button"><span>Download Drupal 6.31</span></a></div>\n<p style="position: inherit;"><strong><a href="/upgrade/">Upgrading</a> your existing Drupal 7 and 6 sites is strongly recommended.</strong> There are no new features or non-security-related bug fixes in these releases. For more information about the Drupal 7.x release series, consult the <a href="http://drupal.org/drupal-7.0">Drupal 7.0 release announcement</a>. More information on the Drupal 6.x release series can be found in the <a href="http://drupal.org/drupal-6.0">Drupal 6.0 release announcement</a>.</p>\n<!--break--><div style="float: right; padding: 0 0 2em 1em; margin-left: 2em; width: 35%; border-left: 1px solid #cdcdcd;">\n<h2>Security information</h2>\n<p>We have a <a href="/security">security announcement mailing list and a history of all security advisories</a>, as well as an <a href="/security/rss.xml">RSS feed with the most recent security advisories</a>.  We <strong>strongly advise Drupal administrators to <a href="/security">sign up</a></strong> for the list.</p>\n<p>Drupal 7 and 6 include the built-in Update Status module (renamed to Update Manager in Drupal 7), which informs you about important updates to your modules and themes.</p>\n<h2>Bug reports</h2>\n<p>Both Drupal 7.x and 6.x are being maintained, so given enough <a href="https://drupal.org/project/issues/search/drupal?status[]=8&amp;categories[]=1">bug fixes</a> (not just <a href="https://drupal.org/project/issues/search/drupal?status[]=1&amp;categories[]=1">bug reports</a>) more maintenance releases will be made available, according to our <a href="http://drupal.org/documentation/version-info#when">monthly release cycle</a>.\n</p></div>\n<h2>Changelog</h2>\n<p>Drupal 7.27 is a security release only. For more details, see the <a href="http://drupal.org/drupal-7.27-release-notes">7.27 release notes</a>.  A complete list of all bug fixes in the stable 7.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/7.x">the git commit log</a>.</p>\n<p>Drupal 6.31 is a security release only. For more details, see the <a href="http://drupal.org/drupal-6.31-release-notes">6.31 release notes</a>.  A complete list of all bug fixes in the stable 6.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/6.x">the git commit log</a>.</p>\n<h2>Security vulnerabilities</h2>\n<p>Drupal 7.27 and 6.31 were released in response to the discovery of security vulnerabilities. Details can be found in the official security advisory:</p>\n<ul><li><a href="http://drupal.org/SA-CORE-2014-002">SA-CORE-2014-002</a></li>\n</ul><p>To fix the security problem, please upgrade to either Drupal 7.27 or Drupal 6.31.</p>\n<h2>Known issues </h2>\n<ul><li>\nThis security release introduces small API changes which may require code updates on sites that expose Ajax or multi-step forms to anonymous users, and where the forms are displayed on pages that are cached (either by Drupal or by an external system).  See the <a href="http://drupal.org/drupal-7.27-release-notes">Drupal 7.27 release notes</a> and <a href="http://drupal.org/drupal-6.31-release-notes">Drupal 6.31 release notes</a> for more information.\n</li>\n<li>\n(Drupal 7 only) This release caused a JavaScript error which breaks Ajax requests in very old browsers (for example, Internet Explorer 8 and earlier); see <a href="https://drupal.org/node/2245331">this issue</a> for details.  The solution is to upgrade to <a href="https://drupal.org/drupal-7.28">Drupal 7.28</a>.\n</li>\n<li>\n(Drupal 7 only) This release caused the <a href="https://drupal.org/project/multiform">Multiple Forms</a> module to stop working correctly.  A fix is available in <a href="https://drupal.org/node/2247527">this issue</a>.\n</li>\n</ul><div style="clear: both; height: 1em;"></div>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/903">Planet Drupal</a></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/102">Drupal 6.x</a></div><div class="field-item odd"><a href="/taxonomy/term/120">Drupal 7.x</a></div></div></div>', 1397678355, '2242651 at https://drupal.org'),
(29, 1, 'Drupal 7.28 released', 'https://drupal.org/drupal-7.28', 'David_Rothstein', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p style="position: inherit;">Drupal 7.28, a maintenance release with numerous bug fixes (no security fixes) is now available for download. See the <a href="http://drupal.org/drupal-7.28-release-notes">Drupal 7.28 release notes</a> for a full listing.</p>\n<div style="float: right; margin: 0 0 1em 1em; text-align: center;">\n<a href="http://ftp.drupal.org/files/projects/drupal-7.28.tar.gz" class="link-button" style="margin: 0 0 0.6em 0;"><span>Download Drupal 7.28</span></a></div>\n<p style="position: inherit;"><strong><a href="/upgrade/">Upgrading</a> your existing Drupal 7 sites is recommended.</strong> There are no major new features in this release. For more information about the Drupal 7.x release series, consult the <a href="http://drupal.org/drupal-7.0">Drupal 7.0 release announcement</a>.</p>\n<!--break--><div style="float: right; padding: 0 0 2em 1em; margin-left: 2em; width: 35%; border-left: 1px solid #cdcdcd;">\n<h2>Security information</h2>\n<p>We have a <a href="/security">security announcement mailing list and a history of all security advisories</a>, as well as an <a href="/security/rss.xml">RSS feed with the most recent security advisories</a>.  We <strong>strongly advise Drupal administrators to <a href="/security">sign up</a></strong> for the list.</p>\n<p>Drupal 7 includes the built-in Update Manager module, which informs you about important updates to your modules and themes.</p>\n<p>There are no security fixes in this release of Drupal core.</p>\n<h2>Bug reports</h2>\n<p>Drupal 7.x is being maintained, so given enough <a href="https://drupal.org/project/issues/search/drupal?status[]=8&amp;categories[]=1">bug fixes</a> (not just <a href="https://drupal.org/project/issues/search/drupal?status[]=1&amp;categories[]=1">bug reports</a>), more maintenance releases will be made available, according to our <a href="http://drupal.org/documentation/version-info#when">monthly release cycle</a>.\n</p></div>\n<h2>Changelog</h2>\n<p>Drupal 7.28 contains bug fixes and small API/feature improvements only. The full list of changes between the 7.27 and 7.28 releases can be found by reading the <a href="http://drupal.org/drupal-7.28-release-notes">7.28 release notes</a>. A complete list of all bug fixes in the stable 7.x branch can be found in <a href="http://drupalcode.org/project/drupal.git/shortlog/refs/heads/7.x">the git commit log</a>.</p>\n<h2>Update notes</h2>\n<p>See the <a href="http://drupal.org/drupal-7.28-release-notes">7.28 release notes</a> for details on important changes in this release.</p>\n<h2>Known issues </h2>\n<p>Changes made to the Update Manager module in this release may lead to performance slowdowns in certain cases (including on rare page loads for site visitors, if the site is using the automated cron feature). See the <a href="http://drupal.org/drupal-7.28-release-notes">release notes</a> for more information.</p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-34 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Front page news:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/903">Planet Drupal</a></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/120">Drupal 7.x</a></div></div></div>', 1399522773, '2261489 at https://drupal.org'),
(30, 1, 'Community Spotlight on Emanuel Greucean, Maurits Dekkers, and Ernő Zsemlye', 'https://drupal.org/node/2271151', 'leighc', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>For this month’s community spotlight, we wanted to showcase three stellar Drupalistas who went above and beyond at the Dev Days Szeged sprints. Emanuel Greucean (<a href="https://drupal.org/user/829152" rel="nofollow">gremy</a>), Maurits Dekkers (<a href="https://drupal.org/user/2126610" rel="nofollow">Mauzeh</a>), and Ernő Zsemlye (<a href="https://drupal.org/user/262120" rel="nofollow">zserno</a>) all made big contributions to the project at <a href="http://drunomics.com/en/blog/drupal-dev-days-szeged-wrap" rel="nofollow">Dev Days Szeged</a>. Here’s a little bit about each.</p>\n<h2>Emanuel Greucean (<a href="https://drupal.org/user/829152" rel="nofollow">gremy</a>)</h2>\n<h3>How did you get involved with Drupal?</h3>\n<p><img src="/files/emanuel2.jpg" class="right" alt="Picture of Emanuel Greucean" />I got involved with Drupal right after college, in 2009. I went to a job interview, showed the employers my enthusiasm about web development and my very not impressive profile, one of which was a Joomla website, and they accepted me. At this job, I got initiated in the art of web development and got a solid education in Drupal. At my first day on the job, I was given the Drupal Developer’s “Bible”  (Pro Drupal Development, 2nd edition), and was told that I had to know it by heart.</p>\n<h3>What do you think open source represents?</h3>\n<p>For me, open source represents the opportunity to have access to awesome products for free. It also represents the opportunity to join a community of passionate developers and to learn a lot, and also to pass on your knowledge. If you are a contributor, it’s also an opportunity to leave a mark, and a joy to know that your work is being used by millions of people.</p>\n<h3>Why did you choose to work in Szeged on beta blocking, and what is your fondest memory from Szeged?</h3>\n<p>One reason for working on beta blockers in Szeged was the desire to get Drupal 8 as close as possible to being released, because I really want to start using it in Production.</p>\n<p>One of my fondest memories from Szeged might be the moment when I actually finished the last missing "Change Record” issue, and with this Drupal 8 change records were up to date for the first time in three years. Also I really appreciate all the help I received from people I had never met before. They initiated me into contributing to the community.</p>\n<h3>Are you working on any fun projects at the moment?</h3>\n<p>Yes. I am currently collaborating with Kalamuna, a Drupal shop from San Francisco''s East Bay Area. They are really great colleagues, and I have the opportunity to work on great projects with them. One of the projects I am most excited about is <a href="http://www.kalamuna.com/products/kalabox" rel="nofollow">Kalabox</a>, and I have to say that I am really enthusiastic about its future.</p>\n<h2>Maurits Dekkers (<a href="https://drupal.org/user/2126610" rel="nofollow">Mauzeh</a>)</h2>\n<h3>How did you get involved with Drupal?</h3>\n<p><img src="/files/1de0507.jpg" class="right" alt="Picture of Maurits Dekkers" />I got involved with Drupal through a client about three years ago. They were using Drupal mainly for its ability to allow site builders to create their own fieldable data structures. Until then I had mostly worked with Zend Framework and Symfony, and I never even knew there was an open source system that could do this! Or course, now I know that there is so much more about Drupal that is awesome, and I cannot imagine a web development life without it!</p>\n<h3>What do you think open source represents?</h3>\n<p>For me, open source represents people (!) who provide their time, effort, and financial resources on something that provides only indirect value. An open source developer spends their free time working on a feature not knowing whether it will actually make it into the final product (unless they are the project lead...). For some this might be an unrewarding way of working because there appear to be few direct, short-term, rewards. So if you contribute something to open source software, you must do it for reasons unrelated to direct income or revenue. Therefore, the passion that people have for the product comes from a much deeper belief.</p>\n<h3>Why did you choose to work in Szeged on Drupal 8 beta blocking/debugging, and what is your fondest memory from Szeged?<br /></h3>\n<p>Despite working with open source software on a daily basis, and lurking around in the issue queues, I never had the guts to really get involved. I realized that getting to know the people behind the nicknames would certainly help because I could just walk over and ask something. So when I saw the announcement for Szeged, I jumped in straight away. And I''m really glad I did. I most remember the people I was working with and having beers with at night, with Cathy (<a href="https://drupal.org/user/258568" rel="nofollow">YesCT</a>) being just amazing to get people up to speed. Her passion for the community is really remarkable. I wanted to learn more about how the Entity API works in Drupal 8, and was directed to <a href="https://drupal.org/user/107158" rel="nofollow">tstoeckler</a> and <a href="https://drupal.org/user/183211" rel="nofollow">plach</a>, from whom I learned very much very quickly.</p>\n<h3>Are you working on any fun projects at the moment?</h3>\n<p>I''m currently working as a freelancer for a few Drupal site building shops. Since I just started as a freelancer in November last year, I''m working quite a lot to make sure I have some financial room to contribute some more to D8.</p>\n<h2>Ernő Zsemlye (<a href="https://drupal.org/user/262120" rel="nofollow">zserno</a>)</h2>\n<h3> How did you get involved with Drupal?</h3>\n<p><img src="/files/IMG_0436_0.jpg" class="right" alt="Picture of Ernő Zsemlye" />It all started during my 4th year at the university. I needed a few more credits for the upcoming semester and stumbled upon a new elective course titled "Open Source Content Management Systems" held by a guy called <a href="https://drupal.org/user/55005 " rel="nofollow">Kristof Van Tomme</a>. I had absolutely no idea about the topic but it sounded pretty cool so I applied. The first lecture was about open source in general and a brief introduction to the Drupal world. At the end of the lecture, Kristof mentioned that he was looking for interns for his new company. I applied the next day and I am sure that was the best move in my career to date. :)</p>\n<h3>What do you think open source represents?<br /></h3>\n<p>I could compare it to traveling. Once you experience what traveling to new places feels like, you suddenly start to feel as if you had been looking at the world through a small and dirty window. Then you also realize how small you are in this life. This is so true for open source.</p>\n<h3>Why did you choose to work in Szeged on Drupal 8 beta blocking/debugging, and what is your fondest memory from Szeged?<br /></h3>\n<p>I wanted to work on something that would give me the opportunity to dive deep into Drupal 8 and learn as much as possible about the new system. I was assigned to an Entity API beta blocker. After having spent my first 3 days on getting my head around all the new things in D8, I got stuck. The next day <a href="https://drupal.org/user/214652" rel="nofollow">Berdir</a> pinged me on IRC that he wanted to discuss the next steps with me in person. We talked for about 5 minutes but that was enough to put me back on track with the issue and also gave me great inspiration that I could talk to a real rockstar in person.</p>\n<h3>Are you working on any fun projects at the moment?<br /></h3>\n<p>I am working at the Central European University as a web developer. We are a small team of four people who maintain virtually any web presence of the whole university: main institutional site with heavy traffic, custom websites for each departments, research groups, alumni campaigns, student groups, etc. It is a constant challenge to use our limited resources to address all arising needs successfully. So we are continuously looking for new ways to create reusable solutions across all these websites. And this is lots of fun. For example I just finished building a custom installation profile based on the fantastic <a href="https://drupal.org/project/panopoly" rel="nofollow">Panopoly</a> distribution so firing up a new website became ridiculously easy.</p>\n<p>---</p>\n<p>Gremy, mauzeh, and zserno were just a few of a huge number of rock stars who worked hard and made great contributions at Szeged. Thank you so much to everyone who turned out for the sprints! The next major sprint event will be at DrupalCon Austin. Our community organizers (led by <a href="https://drupal.org/user/258568" rel="nofollow">YesCT</a>) have worked hard to make sure we''ll have seven days of sprints that culminate in a huge sprint on <a href="https://austin2014.drupal.org/sprints" rel="nofollow">Friday, June 6</a>. We hope to see you there.</p>\n</div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Drupal version:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/20236">Drupal 8.x</a></div></div></div>', 1400601781, '2271151 at https://drupal.org'),
(31, 2, 'Gábor Hojtsy: Drupal 8 multilingual tidbits 15: configuration translation basics', 'http://hojtsy.hu/blog/2014-may-19/drupal-8-multilingual-tidbits-15-configuration-translation-basics', '', '<div class="field field-name-body field-type-text-with-summary field-label-hidden view-mode-rss"><div class="field-items"><div class="field-item even"><p>After a long 8 months break in the article series, we are back to talk about configuration translation basics. Why the long break? Well, both the configuration and content system was in heavy development with changes and I did not want to get you content that would be quickly outdated. Hopefully now it is safer to talk about what is going to end up in Drupal 8 for these systems. If not, well, then I’m sorry. We’ll cover configuration first because that is more baked.</p>\n<h3>The Drupal 8 configuration system is a boon for language</h3>\n<p>As I wrote <a href="http://hojtsy.hu/blog/2013-sep-13/drupal-8-multilingual-tidbits-14-intro-content-and-configuration">in the previous article in the series</a>, configuration is now encompassing lots of settings that were variables or used custom settings storage in Drupal 7. The biggest value for non-English and multilingual sites in Drupal 8 of the configuration changes is that now a common system is used to manage your site name, email text settings through to views, field settings, entity form displays, etc. We can introduce language and translation support in a way that modules will need to plan with. It is not just an optional contributed add-on but a core feature.</p>\n</div></div></div>', 1400519603, ''),
(32, 2, 'Acquia: How to: Responsive, Full-width Banners', 'https://www.acquia.com/blog/how-responsive-full-width-banners', '', '<div class="field field-name-body field-type-text-with-summary field-label-hidden">\n    <div class="field-items">\n          <div property="content:encoded" class="field-item even"><p>As a front-end developer for acquia.com, I''ve had lots of fun and challenging design requests come my way. Most recently I was tasked with swapping out the static homepage graphic with a full-width, responsive slideshow banner that can also be tested and personalized using <a href="/products-services/website-personalization">Acquia Lift</a>.</p></div>\n      </div>\n</div>\n<span property="dc:title" content="How to: Responsive, Full-width Banners" class="rdf-meta"></span>', 1400521294, ''),
(33, 2, 'DrupalCon Amsterdam: Take the Drupal Business Survey', 'https://amsterdam2014.drupal.org/news/take-drupal-business-survey', '', '<div class="field field--name-body field--type-text-with-summary field--label-hidden"><div class="field__items"><div class="field__item even"><p>To develop the content for the Business Track at Drupalcon Europe this year we''re conducting surveys to find the areas in which all Drupal businesses can improve.</p>\n<p>I <a href="http://wunderroot.co.uk/blog/drupalcon-europe-business-track-theme-ideas">blogged recently</a> about my initial thinking on the theme of the business track at DrupalCon Amsterdam this year.</p>\n<p>Janne Kalliola, my co-chair and I decided to conduct a series of surveys to identify the strengths and weaknesses of businesses providing Drupal related services. From the findings we can then provide guidance to those proposing sessions for the conference in Amsterdam later this year.</p>\n<p>We''re launching 3 surveys — one for clients of Drupal businesses, one for the leaders of the businesses, and one for the staff of the businesses.</p>\n<p>We''d really appreciate you filling in the survey that relates to you, and letting others know about this blog post so they can choose the survey that relates to them:</p>\n<ul><li><a href="http://wunder.webform.com/form/12036">Client Survey</a>\n</li><li><a href="http://wunder.webform.com/form/12041">Staff Survey</a>\n</li><li><a href="http://wunder.webform.com/form/12040">Owners/managers Survey</a>\n</li></ul><p>The results are anonymous, and aggregated data will be published. Act quickly, the surveys close on the 28th of May. </p>\n<p>If you have any questions about the survey you can contact me at <a href="mailto:steve.parks@wunderroot.co.uk">steve.parks@wunderroot.co.uk</a>.</p>\n<p>--<br />\nThe DrupalCon Amsterdam Drupal Business Track Team<br />\nSteve Parks, Wunderroot<br />\nJanne Kalliola, Exove</p>\n</div></div></div>', 1400565600, ''),
(34, 2, 'TimOnWeb.com: Adding a custom extra field to entity / node display', 'http://timonweb.com/adding-a-custom-extra-field-to-entity-node-display', '', '<div class="field field-name-field-image field-type-image field-label-hidden"><a href="http://timonweb.com/adding-a-custom-extra-field-to-entity-node-display"><img typeof="foaf:Image" src="http://timonweb.com/sites/default/files/styles/post-images/public/post-images/extra-field_0.png?itok=pK8mzHYY" width="150" height="150" alt="" /></a></div><div class="field field-name-body field-type-text-with-summary field-label-hidden"><p>I had a case recently, where I needed to add custom data to the node display and wanted this data to behave like a field, however the data itself didn''t belong to a field. By "behaving like a field" I mean you can that field at node display settings and able to control it''s visibility, label and weight by dragging and dropping that field.</p>\n<p>So, as you may have undestood, <b>hook_preprocess_node / node_view_alter</b> approach alone wasn''t enough.</p></div><div class="field field-name-taxonomy-vocabulary-1 field-type-taxonomy-term-reference field-label-hidden">\n    <span class="field-items">\n                  <a href="http://timonweb.com/categories/drupal" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">Drupal</a>            </span>\n</div>\n<div class="field field-name-taxonomy-vocabulary-2 field-type-taxonomy-term-reference field-label-above">\n      <h3 class="field-label">Tags&nbsp;</h3>\n    <span class="field-items">\n                  <a href="http://timonweb.com/tags/drupal-7" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">drupal 7</a>,                 <a href="http://timonweb.com/tags/drupal-planet" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">drupal planet</a>            </span>\n</div>\n Read on about <a href="http://timonweb.com/adding-a-custom-extra-field-to-entity-node-display">Adding a custom extra field to entity / node display</a>', 1400574220, ''),
(35, 2, 'Janez Urevc: Drupal community, please meet Jayesh Solanki', 'http://janezurevc.name/drupal-community-please-meet-jayesh-solanki', '', '<div class="field field-name-body field-type-text-with-summary field-label-hidden view-mode-rss"><div class="field-items"><div class="field-item even" property="content:encoded"><p><a href="https://drupal.org/user/2832795">Jayesh</a> is one of the <a href="http://drupal.org">Drupal''s</a> students that were accepted into <a href="https://en.wikipedia.org/wiki/Google_SoC">Google Summer of code</a> program this year. <a href="https://groups.drupal.org/node/423263">He wrote an introduction post</a> to say hi and explain what he''s working on.</p>\n</div></div></div>', 1400582957, ''),
(36, 2, 'Drupal Association News: Improving Drupal.org support', 'https://assoc.drupal.org/blog/tvn/improving-drupalorg-support', '', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p><img class="left" width="300px" src="https://assoc.drupal.org/files/support.png" />Per the <a href="https://assoc.drupal.org/node/18858">2014 Leadership plan</a>, one of the imperatives for the Drupal Association is making Drupal.org a great tool for the Drupal community, building Drupal adoptions and developer satisfaction. One very important part of a great tool is great user support. The speed and ease with which users can get help when they have a problem greatly affects overall experience.</p>\n<p>As with many other things on Drupal.org, historically support has been provided by an amazing group of community volunteers with a little help from the Drupal Association staff. Recently the Drupal Association staff had to step in heavily during a few intense times, such as after the security incident last May, when we reset all user passwords. Association staff answered hundreds of support requests, 24 hours a day, over the week following the incident.</p>\n<p>The site is growing and demand for support is growing as well. Luckily so is the Drupal Association’s tech team. As we get more bandwidth, we are planning to do more in terms of user support. Not just when there is a security incident, but on a daily basis.</p>\n<p>What are all the channels where Drupal.org users can get support? There are some old and some new ones:</p>\n<h2>Issue queues</h2>\n<p>Issue queues, of course, are the main and most important channel. The ones our team members monitor on a constant basis are:</p>\n<ul><li><a href="https://drupal.org/project/content ">Content</a></li>\n<li><a href="https://drupal.org/project/webmasters">Webmasters</a></li>\n<li><a href="https://drupal.org/project/infrastructure">Infrastructure</a></li>\n<li><a href="https://drupal.org/project/association_drupalorg">Association.drupal.org</a></li>\n</ul><p>The first step for most of the issue queues is cleaning up the backlog. Recently we had our first <a href="https://groups.drupal.org/node/418388">issue queue clean up sprint</a>. There were 675 issues in the Webmasters, 200 in the Content and 336 in the Infrastructure queue before the sprint. A group of 11 people — community members and staff — cleaned up about 300 issues total.</p>\n<p>We still have lots though (398 in the Webmasters, 179 in the Content, 311 in the Infrastructure) and are planning to organize more sprints like that. The next one will likely take place during <a href="https://austin2014.drupal.org/sprints">DrupalCon Austin</a>.</p>\n<p>We want to stress that community involvement is at the heart of the Drupal Project. Although we have increased the staff commitment to support, we do not intend or desire to displace the enthusiastic and productive volunteers who have put so much time and energy into supporting the community. We will continue to work closely with volunteers to ensure that we find the right balance of actions for each of us so that we support and enhance each others efforts. </p>\n<h2>ZenDesk</h2>\n<p>We first used ZenDesk last May, when lots of people were not able to log in and therefore were not able to open an issue about it. This continues to be a problem. Sometimes people lose access to their Drupal.org account, or they are not able to log in for other reasons. The only way for them to ask for help is create another account and open an issue. </p>\n<p>To make this easier for people, we decided to keep the help@drupal.org email account and increase its use. Our plan is to use ZenDesk only for the cases when people cannot actually log in to the site. All the other requests will be forwarded to the issue queues.</p>\n<h2>IRC</h2>\n<p>There are a few <a href="https://drupal.org/irc">IRC</a> channels where staff members already hang out and provide support alongside community volunteers: #drupalorg, #drupal-infrastructure, #drupal-association.</p>\n<h2>Twitter</h2>\n<p>There are two Drupal.org related Twitter accounts <a href="https://twitter.com/drupal_org">@drupal_org</a> and <a href="https://twitter.com/drupal_infra">@drupal_infra</a>, which are used to share various Drupal.org news and announcements. They are also used by the community to ask for tips and help related to Drupal.org.</p>\n<h2>Site contact form</h2>\n<p>We are planning to forward requests from the form to help@drupal.org. All requests, which are not related to people unable to log in will be forwarded to the issue queues.</p>\n<p>If there anything else we’ve missed in terms of support channels, let us know!</p>\n<h2>Metrics</h2>\n<p>There are a few metrics we are tracking in the Drupal Association related to user support on Drupal.org. We are happy to report that last month average response time in Drupal.org-related issue queues went down from 56.65 hours to <strong>16.82 hours</strong>! About 90% of issues received their first response within 48 hours after the issue was published. These are the results of a great work by the community volunteers (dddave, nevets, silverwing, WorldFallz, dman, and many more), Association staff and especially Lizz Trudeau (<a href="https://drupal.org/user/1184486">lizzjoy</a>), who <a href="https://assoc.drupal.org/blog/lizzjoy/helping-customer-service-coordinator">joined our team</a> as a customer support coordinator exactly a month and a few weeks ago.</p>\n<p>We already can see positive changes and are not going to stop. We’ll continue to streamline tools and processes, so that community volunteers together with the Drupal Association staff could provide better support for our users and improve these numbers even more.</p>\n</div></div></div>', 1400585563, ''),
(37, 2, 'Acquia: Amitai Burstein: Zariz - Continuous Deployment for Content', 'https://www.acquia.com/resources/podcasts/acquia-podcast-139-continuous-content-deployment-amitai-burstein', '', '<div class="field field-name-body field-type-text-with-summary field-label-hidden">\n    <div class="field-items">\n          <div property="content:encoded" class="field-item even"><p>I got the chance a while back to speak with Amitai Burstein, CTO of <a href="http://www.gizra.com/">Gizra</a> - a boutique development shop in Tel Aviv creating advanced web applications using Drupal, along with Node.js, Jekyll and other technologies. Amitai is the maintainer of key Drupal modules such as Organic Groups, Message and Entity Reference, and contributes to Drupal core. He showed off Gizra''s intriguing solution to content deployment in Drupal in this jam''s Drupal Camp session: Zariz. I was impressed! You might be, too.</p>\n</div>\n      </div>\n</div>\n<span property="dc:title" content="Amitai Burstein: Zariz - Continuous Deployment for Content" class="rdf-meta"></span>', 1400591101, ''),
(38, 2, 'Drupalize.Me: Drupal 8 is Responsive, But What Does That Mean?', 'http://drupalize.me/blog/201405/drupal-8-responsive-what-does-mean', '', '<div class="field field-name-body field-type-text-with-summary field-label-hidden text-content text-secondary"><div class="field-items"><div class="field-item even"><p>Drupal 8''s out-of-the-box mobile friendliness creates quite the buzz. "Mobile friendly," "responsive," "squishy" — all words to describe the behavior a site invokes on different devices or different screen sizes. Mobile friendly can also mean content first. From a big screen to a little screen, things look different. Images change sizes, menu items become drop-downs, columns are pushed around to locations that make sense with content being the supreme real-estate. So if Drupal is mobile friendly out of the box that must mean I am 100% good to go with all my websites using Drupal 8. We wish. Drupal 8 is coming along and looking pretty sweet, but it is still Drupal and not a magic unicorn. This blog post is not going to get into the nitty gritty of how responsive websites work, but we''re going to take a closer look at how two new core modules can make it easier to build a responsive theme. </p></div></div></div>', 1400597356, ''),
(39, 2, 'Open Source Training: Add CSS Style to Drupal Views', 'http://feedproxy.google.com/~r/ostrainingdrupal/~3/C7pfMvcMTe0/', '', '<p>This week one our OSTraining members was working with the Views module.</p>\n<p>They were able to create views, but weren''t sure how to improve their design.</p>\n<p>In this tutorial, we''re going to show you how to apply CSS to your views so you can add both color and width.</p><img src="http://feeds.feedburner.com/~r/ostrainingdrupal/~4/C7pfMvcMTe0" height="1" width="1"/>', 1400598271, '');
INSERT INTO `aggregator_item` (`iid`, `fid`, `title`, `link`, `author`, `description`, `timestamp`, `guid`) VALUES
(40, 2, 'Appnovation Technologies: The Current State of Drupal: An Infographic', 'http://www.appnovation.com/blog/current-state-drupal-infographic', '', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even" property="content:encoded"> Here are some current stats on Drupal in an inforgraphic. Drupal is an ever expanding CMS so these numbers have already become larger! However, this will give you some quick facts about our favourite CMS!  </div></div></div><div class="field field-name-field-blog-header-image field-type-image field-label-hidden"><div class="field-items"><div class="field-item even"><a href="/blog/current-state-drupal-infographic"><img typeof="foaf:Image" src="http://www.appnovation.com/sites/default/files/styles/blog_listing_page_header/public/drupalinfoheader.jpg?itok=aHHs5x0b" width="680" height="200" alt="" /></a></div></div></div><div class="sharethis-buttons"><div class="sharethis-wrapper"><span st_url="http://www.appnovation.com/blog/current-state-drupal-infographic" st_title="The Current State of Drupal: An Infographic" class="st_facebook"></span>\n<span st_url="http://www.appnovation.com/blog/current-state-drupal-infographic" st_title="The Current State of Drupal: An Infographic" class="st_twitter"></span>\n<span st_url="http://www.appnovation.com/blog/current-state-drupal-infographic" st_title="The Current State of Drupal: An Infographic" class="st_sharethis"></span>\n<script type=''text/javascript''>var switchTo5x = false;</script><script type=''text/javascript'' src=''http://w.sharethis.com/button/buttons.js''></script><script type=''text/javascript''>stLight.options({"publisher":"dr-75626d0b-d9b4-2fdb-6d29-1a20f61d683"});</script></div></div>', 1400599855, ''),
(41, 2, 'DrupalCon Austin News: Community Summit - Contribute your expertise to build our Global Communities', 'https://austin2014.drupal.org/news/community-summit-contribute-your-expertise-build-our-global-communities', '', '<div class="field field--name-body field--type-text-with-summary field--label-hidden"><div class="field__items"><div class="field__item even" property="content:encoded"><p>Thousands of Drupalers will be covering in Austin with one goal in mind, to live and breathe Drupal.  With the success of the DrupalCon Prague 2013 Community Summit, leaders are called to action again to discuss and sprint on important Drupal Community topics.  </p></div></div></div>', 1400599939, ''),
(42, 2, 'Cocomore: DrupalCamp Spain 2014', 'http://drupal.cocomore.com/blog/drupalcamp-spain-2014', '', '<p>Last weekend three of us from Cocomore attended to <a href="http://2014.drupalcamp.es/">DrupalCamp Spain 2014</a>. This year it was held in the beautiful city of Valencia, at the East Coast of Spain, full of magnificent buildings and the land of Paella and Horchata. Because we know of the importance of these events, this Drupalcamp was sponsored by Cocomore.</p>\n\n<p><a href="http://2014.drupalcamp.es/"><img src="/sites/default/files/uploaded_files/badge02_imgoing_orange.png" width="600" height="300" alt="badge02_imgoing_orange.png" /></a></p> <p><a href="http://drupal.cocomore.com/blog/drupalcamp-spain-2014" target="_blank">read more</a></p>', 1400602187, ''),
(43, 2, 'Phase2: Creating Custom Panels Layouts & Content Types', 'http://www.phase2technology.com/blog/creating-custom-panels-layouts-content-types/?utm_source=rss&utm_medium=rss&utm_campaign=creating-custom-panels-layouts-content-types', '', '<p dir="ltr">The <a href="https://drupal.org/project/panels">Panels module</a> provides a flexible and intuitive way to place content throughout your site. This blog post will show you how to use and customize some of the features in panels including layouts and content types.</p>\n<h1>Layouts</h1>\n<p><img alt="" src="https://lh6.googleusercontent.com/0iHsaVAZ8agvAY6ovqFQA7djAvFSkNCHsOszY1_lCKIqNbkqj7JRyD9-CAbbuTQDSHVWDWv2Omm_37ncZc1HL1K7Wz2Pt-n6jPzBKFdiKjfvnHTQrFES-77Kne6Au63UMw" width="468px;" height="212px;" /></p>\n<p dir="ltr">As it sounds, layouts allow users to choose where each piece of content on a given panel can be rendered. There are two different types of layouts. Builders allow users to create a custom layout inside the GUI via the layout Designer, while predefined layouts allow you to write the actual html to be used within your layout. This blog post will cover the latter option.</p>\n<p dir="ltr">When creating a layout you can create one either inside your theme or within your module. For this example we will be creating a two-column layout using the theme implementation. In your theme create a folder named “layouts” and in your theme_name.info file add the following lines.</p>\n<p></p><pre class="crayon-plain-tag">; Panel Layouts\n\nplugins[panels][layouts] = layouts</pre><p></p>\n<p dir="ltr">This line tells the theme to look for custom layouts within our layouts directory inside our theme. Inside of your Layout’s folder, create a folder called one_third_left and inside of that folder create three files, one_third_left.inc, one-third-left.tpl.php, one-third-left.css. Your directory structure should be as follows:</p>\n<p> <img alt="" src="https://lh4.googleusercontent.com/pxvL_5Ib9hew_BtPLVy-wGUt89fZONMX8412YeTNKFWlbZNvgmw4d383na-w7cd5-xcc4UXvkTanGOpsLqrgjEinbQPTjaS4Tfh_cZkBGRav5gmarq2Pnip6S91VpBeang" width="236px;" height="112px;" /></p>\n<p dir="ltr">The .inc file controls the regions that are present as well as the theme and css to be used within the layout. Open the one_third_left.inc file and add the following lines.</p>\n<p></p><pre class="crayon-plain-tag">&lt;?php\n\n/**\n* Implements hook_panels_layouts()\n*/\nfunction theme_name_one_third_left_panels_layouts() {\n\n  $items[''one_third_left''] = array(\n    ''title'' =&gt; t(''Theme Name: One Third Left''),\n    ''category'' =&gt; t(''Theme Name''),\n    ''icon'' =&gt; ''one-third-left.png'',\n    ''theme'' =&gt; ''one-third-left'',\n    ''css'' =&gt; ''one-third-left.css'',\n    ''regions'' =&gt; array(\n      ''header'' =&gt; t(''Header''),\n      ''content'' =&gt; t(''Content''),\n      ''sidebar'' =&gt; t(''Sidebar''),\n    ),\n  );\n\n  return $items;\n}</pre><p></p>\n<p dir="ltr">This array defines all the needed items for a layout to appear. The title as it sounds, is the title of the panel we created. Category is used to group similar layouts together. When choosing a layout you first need to select the category and then the corresponding layouts will be shown. The icon is a visible representation to help users see what the layout looks like at a glance (The icon was omitted for this tutorial). The theme is the tpl file used to control the layout and html. Css controls the styling of the layout, it is also important to know that the css file is also used to control the layout shown inside the gui. Regions are used to define where content can be placed inside of the layout.</p>\n<p dir="ltr">Open one-third-left.tpl.php and add the following lines.</p>\n<p></p><pre class="crayon-plain-tag">&lt;div &lt;?php !empty($css_id) ? print ''id="'' . $css_id . ''"'' : ''''; ?&gt;&gt;\n  &lt;div class="columns"&gt;\n    &lt;div class="header"&gt;\n      &lt;?php print $content[''header''];?&gt;\n    &lt;/div&gt;\n  &lt;/div&gt;\n  &lt;div class="medium-4 columns left-sidebar"&gt;\n    &lt;?php print $content[''sidebar''];?&gt;\n  &lt;/div&gt;\n  &lt;div class="medium-8 columns"&gt;\n    &lt;?php print $content[''content''];?&gt;\n  &lt;/div&gt;\n&lt;/div&gt;</pre><p></p>\n<p dir="ltr">In this tpl example, we are creating a 2 column layout with a header. Notice the $content variable. Each of these corresponds to a region that we created inside of our .inc file. To add more regions simply add them to the .inc file and place them in the tpl. I will not cover the css in this tutorial but once cache is cleared you should now see your new layout available for use.</p>\n<h1 dir="ltr">Content Types</h1>\n<p dir="ltr">Ctools content types are like blocks in the sense that they both provide an easy way to create pieces of content that can be placed throughout a site. Where content types excel is in the configuration. While blocks allow you to configure them by means of a form, those settings are global, so every instance of a block will have the same settings no matter where it is placed. Content Types on the other hand allow you to create one content type and have different settings applied. This portion of the tutorial will discuss how a ctools content type can be created.</p>\n<p dir="ltr">First add ctools as a dependency in your module_name.info file.</p>\n<p></p><pre class="crayon-plain-tag">dependencies[] = ctools</pre><p></p>\n<p dir="ltr">Create a folder named “plugins” inside of your module directory. Next add a folder named “content_types” inside of the newly created plugins directory. Then add the following lines to your module_name.module file.</p>\n<p></p><pre class="crayon-plain-tag">&lt;?php\n\n/*\n* Implements hook_ctools_plugin_directory().\n*/\nfunction module_name_ctools_plugin_directory($owner, $plugin_type) {\n  if ($owner == ''ctools'' &amp;&amp; $plugin_type == ''content_types'') {\n    return ''plugins/content_types'';\n  }\n}</pre><p></p>\n<p dir="ltr">This hook tells ctools where to look for its content types. In this example we will create a simple content type that displays the 5 newest published nodes and allows the user to choose whether or not the title is linkable.</p>\n<p dir="ltr">Inside the content_type folder, create another folder called newest_node and inside that folder create a file called newest_nodes.inc. Add the following lines to the file.</p>\n<p></p><pre class="crayon-plain-tag">&lt;?php\n\n$plugin = array(\n  ''title'' =&gt; t(''Newest Nodes''),\n  ''description'' =&gt; t(''Display a list of the newest nodes''),\n  ''single'' =&gt; TRUE,\n  ''render callback'' =&gt; ''newest_nodes_content_type_render'',\n  ''defaults'' =&gt; array(),\n  ''edit form'' =&gt; ''newest_nodes_edit_form'',\n  ''category'' =&gt; array(t(''My Module'')),\n);</pre><p></p>\n<p dir="ltr">This array is used to define our settings for the content type. As it sounds, title is the title of the content type. Single is used to show that our content type has no subtypes. The render callback is the function that is used to generate the markup for our content type. Defaults is the default ctools context. In our case we do not have one. The edit form is the form function used to generate the content type settings. Finally category is used to group similar content types. To add the form add the following lines.</p>\n<p></p><pre class="crayon-plain-tag">/**\n* Content type settings form.\n*/\nfunction newest_nodes_edit_form($form, &amp;$form_state) {\n\n  $conf = $form_state[''conf''];\n\n  $form[''number''] = array(\n    ''#type'' =&gt; ''select'',\n    ''#title'' =&gt; t(''Select the number of node to display''),\n    ''#options'' =&gt; array(5 =&gt; t(''Five''), 10 =&gt; t(''Ten''), 15 =&gt; t(''Fifteen'')),\n    ''#required'' =&gt; TRUE,\n    ''#default_value'' =&gt; isset($conf[''number'']) ? $conf[''number''] : ''''\n  );\n\n  $form[''link''] = array(\n    ''#type'' =&gt; ''checkbox'',\n    ''#title'' =&gt; t(''Link title to node''),\n    ''#default_value'' =&gt; isset($conf[''link'']) ? $conf[''link''] : '''',\n  );\n\n  return $form;\n}\n\n/**\n* Content type submit handler.\n*/\nfunction newest_nodes_edit_form_submit($form, &amp;$form_state) {\n  foreach (array(''number'', ''link'') as $key) {\n    $form_state[''conf''][$key] = $form_state[''values''][$key];\n  }\n}</pre><p></p>\n<p dir="ltr">This simple form let users decide how many nodes to display and whether or not a link should be displayed. Now lets proceed with adding the actual render function.</p>\n<p></p><pre class="crayon-plain-tag">function newest_nodes_content_type_render($subtype, $conf, $args, $context) {\n\n  $results = db_select(''node'', ''n'')\n    -&gt;fields(''n'', array(''nid'', ''title''))\n    -&gt;condition(''status'', 1)\n    -&gt;range(0, $conf[''number''])\n    -&gt;execute()\n    -&gt;fetchAll();\n\n  $items = array();\n\n  foreach ($results as $result) {\n    if (isset($conf[''link''])) {\n      $items[] = l($result-&gt;title, ''node/'' . $result-&gt;nid);\n    }\n    else {\n      $items[] = $result-&gt;title;\n    }\n  }\n\n  $block = new stdClass();\n  $block-&gt;title = t(''Newest Nodes'');\n  $block-&gt;content = theme(''item_list'', array(''items'' =&gt; $items));\n\n  return $block;\n}</pre><p></p>\n<p dir="ltr">This function does a simple db_select using the variables we set in our form to limit the number of items displayed and to also decide whether or not to display a link. Clear your cache and you should now see your newly created content type available along with the settings form.</p>\n<p> <img alt="" src="https://lh5.googleusercontent.com/2FJdZqF_T2Qd6ktykvTFMnNZQVRlibvBXpoBTzbGlBbXUhCI_JIyjtRJplqeJyyaTuqliOr79bsnKtVp1Z6mekn7S0H1V073VbvbntGoOW0AliWZoR4JVT9N7sLmaw1wCg" width="327px;" height="259px;" /></p>\n<p><img alt="" src="https://lh4.googleusercontent.com/6-4KUiCzR4GpU9ZDHzJm7jEm31_Rm2wMt5lqLZNy7KU-14Hn8CbYKRIw3BKqQGUXClgUTO25PLTviD8NxiI45z3Air-H_nAjcxfco-GQ3RLPPukiJ0hOmoW55B7L50XxEA" width="410px;" height="198px;" /></p>\n<h2 dir="ltr">Finally here is what my Content Type looks like once styled.</h2>\n<p><img alt="" src="https://lh4.googleusercontent.com/32DJrbiGeYJ9o32OekblGeOnI3NJH1ri_YiXXExAJNq6jzXS_0SUvNISItwmvYmTtvwmX-OehKdTpOBeOK5cuD8j4NwMg7xEvseUp4rCGQaQiu9HsWpSIqNqT89ji3xhsw" width="207px;" height="197px;" /></p>\n<p>While my previous example is a bit on the simplistic side it does highlight the power of ctools layouts and content types. When used with the appropriate CSS responsive layouts can be created and easily changed per node type. For more information on the Panels Module, check out some of our other <a href="http://www.phase2technology.com/?s=panels">Phase2 thoughts.</a></p>', 1400604607, ''),
(44, 2, 'Phase2: Our Top 10 DrupalCon Austin Session Picks!', 'http://www.phase2technology.com/blog/our-top-10-drupalcon-austin-session-picks/?utm_source=rss&utm_medium=rss&utm_campaign=our-top-10-drupalcon-austin-session-picks', '', '<p dir="ltr">It’s less than 2 weeks from DrupalCon Austin and we are pumped to check out this year’s awesome DrupalCon Austin session lineup. With so many sessions to choose from, it can be hard to pick which ones to attend, so planning your session strategy is essential. To help you decide, we’ve put together our top 10 DrupalCon Austin session picks below, we&#8217;ll see you there!</p>\n<h1 dir="ltr">Monday</h1>\n<h3 dir="ltr"><strong>9:00-5:00PM:</strong>  <a href="https://austin2014.drupal.org/training/drupal-performance-and-scalability-dream-team">Drupal Performance and Scalability with the Dream Team</a>.</h3>\n<p dir="ltr">The dream team unites again to provide an epic performance and scaling training to kick off this year&#8217;s DrupalCon.  You&#8217;ll find our own DevOps guru, Steven Merrill among this infamous team and while this isn&#8217;t a DrupalCon session, it is definitely a training not to be missed. Try to grab a seat!</p>\n<h1 dir="ltr">Tuesday</h1>\n<h3 dir="ltr"><strong>1:00-2:00PM:</strong> <a href="https://austin2014.drupal.org/session/30-drupal-8-api-functions-you-should-already-know">30 Drupal 8 API Functions You Should Already Know</a>, Rm: 18, 4th floor</h3>\n<p dir="ltr">You wont want to miss one of Phase2&#8242;s leading developers, <a href="http://www.phase2technology.com/author/fmitchell/">Frederic Mitchell</a> presenting a session on Drupal 8 API functions.  You can get a sneak peak of what his session will cover in his blogpost &#8220;<a title="Permalink to Say Goodbye To menu_get_object() @NYC Camp" href="http://www.phase2technology.com/blog/goodbye-menu-get-object/" rel="bookmark">Say Goodbye To menu_get_object()</a>.&#8221;</p>\n<h3 dir="ltr"><strong>1:00-2:00PM:</strong> <a href="https://austin2014.drupal.org/session/openshift-and-drupal-story-true-open-source-collaboration-and-innovation">OpenShift &amp; Drupal- A True Story of Open Source Collaboration</a>, Rm 11,4th floor</h3>\n<p dir="ltr">Have you heard about using <a href="http://origin.openshift.com/">OpenShift Origin</a> with Drupal? Get all the details and find out how to easily deploy Drupal sites on OpenShift Origin in this session with <a href="http://www.phase2technology.com/author/smerrill/">Steven Merrill</a> and <a href="https://twitter.com/pythondj">Diane Mueller</a>.</p>\n<h3 dir="ltr"><strong>3:45-4:45:</strong> <a href="https://austin2014.drupal.org/session/introducing-drupal-8-configuration-system">Introducing The Drupal 8 Configuration System</a>, Rm F, 4th Floor</h3>\n<p dir="ltr">Drupal 8 has a new configuration management system that provides a central place for modules to store configuration data, from simple static data (e.g., site name) to more complex business objects (e.g., field definitions and image styles). This session will outline how to work with the new configuration system from a site building perspective. Looks like a great D8 session, we can&#8217;t wait!</p>\n<h3 dir="ltr"><strong>5:00-6:00PM:</strong> <a href="https://austin2014.drupal.org/session/train-wrecks-ugly-babies-gory-details-part-2">Train Wrecks, Ugly Babies- The Gory Details Part 2</a>, Rm 16, 4th Floor</h3>\n<p>As a follow up to <a href="https://drupal.org/user/114508">Susan Rust</a>&#8216;s previous session &#8220;Train Wrecks, Ugly-Baby..Meetings and other Client Calamities,&#8221; Susan further discusses project methodology and the importance of discovery and strategic planning.  We are a big fan of Susan and look forward to her session!</p>\n<h1 dir="ltr">Wednesday</h1>\n<h3 dir="ltr"><strong>1:00-2:00:</strong> <a href="https://austin2014.drupal.org/session/introduction-panopoly-and-drupal-distributions">Introducing Panopoly and Drupal Distributions</a>, Rm 17, 4th Floor</h3>\n<p>If you are interested in how Panopoly works and how it is used in Drupal distributions, be sure to catch <a href="https://drupal.org/user/266527">David Snopek</a>&#8216;s session! David is a fantastic <a href="http://openatrium.com">Open Atrium</a> and Panopoly contrbutor and has a ton of knowledge under his belt about both distributions!</p>\n<h3 dir="ltr"><strong>3:45-4:45PM:</strong> <a href="https://austin2014.drupal.org/session/successful-requirements-gathering">Successful Requirements Gathering</a>, Rm 16, 4th floor</h3>\n<p dir="ltr"><a href="http://www.phase2technology.com/author/jhirsch/">Jordan Hirsch</a> is a senior digital strategist here at Phase2.  He is not only a professional improv actor, he also is an expert in requirements gathering for large complicated web projects.  Check out his session at DrupalCon and take a sneak peak at some of his requirements best practices in his <a href="http://www.phase2technology.com/blog/what-the-heck-are-we-building-10-steps-to-successful-requirements-gathering/">blogpost </a>about this topic.</p>\n<h3 dir="ltr"><strong>3:45-4:45PM:</strong> <a href="https://austin2014.drupal.org/session/thinking-inside-box-inside-box-inside-box">Thinking Inside The Box, Inside The Box, Inside The Box</a>,  Rm F, 4th floor</h3>\n<p dir="ltr">For all you frontend developers out there, be sure to catch <a href="https://twitter.com/codingdesigner">Mason Wendell</a>&#8216;s session where he will be discussing how to leverage style prototypes as a frontend style guide technique.</p>\n<h1 dir="ltr">Thursday:</h1>\n<h3 dir="ltr"><strong>10:45-11:45:</strong> <a href="https://austin2014.drupal.org/session/scaling-drupal-higher-ed-institutions">Scaling Drupal For Higher-Ed Institutions</a>, Rm 16, 4th Floor</h3>\n<p>For those interested in Drupal for higher ed, be sure to catch this session, we are really excited to attend this session with their incredible line up of representatives from Dartmouth College, Harvard University, Stanford University, and Yale University.</p>\n<h3 dir="ltr"><strong>2:15-3:15PM:</strong> <a href="https://austin2014.drupal.org/session/drupal-local-gov-how-san-mateo-county-raising-bar-openpublic">Drupal For Local Gov- How San Mateo raised the bar with </a><a href="https://austin2014.drupal.org/session/drupal-local-gov-how-san-mateo-county-raising-bar-openpublic">OpenPublic</a>, Rm 17, 4th floor</h3>\n<p dir="ltr">If you are interested in Drupal for public sector sites, you won&#8217;t want to miss this session.  Join <a href="http://www.phase2technology.com/author/fhaynes/">Felicia Hayes</a> of Phase2 and Beverly Thames from San Mateo County to talk about how <a href="http://www.phase2technology.com/client/san-mateo-county/">San Mateo County</a> leveraged Drupal and OpenPublic to create an engaging web experience. will present a session on the <a href="http://www.phase2technology.com/client/san-mateo-county/">San Mateo project</a> with Beverly Thames of San Mateo.</p>\n<p dir="ltr">With all these interesting Drupal sessions to attend, make sure to pace yourself, take a break and visit us at the Phase2 booth (#101)! As always we&#8217;ve got some fun swag and activities planned at our booth, so be sure to schedule some time to come say hi!</p>', 1400609316, ''),
(45, 2, 'Freelock : Ask Freelock: Collaborative Editing in OpenAtrium and Drupal?', 'http://www.freelock.com/blog/john-locke/2014-05/ask-freelock-collaborative-editing-openatrium-and-drupal', '', '<div class="g-plusone-wrapper" style="margin: 0 1em 1em 1em;float:right" ><g:plusone href="http://www.freelock.com/blog/john-locke/2014-05/ask-freelock-collaborative-editing-openatrium-and-drupal" size="medium" annotation="bubble" width="250" ></g:plusone></div><div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"> <p>We''ve been getting several inquiries related to document management in Drupal, and occasionally about OpenAtrium, a Drupal distribution we''ve used as a base for several projects that needed strong group collaboration functionality.</p>\n<p>Heerad asks:</p>\n<blockquote><p>How does OpenAtrium handle collaborative editing of documents?</p></blockquote></div></div></div><div class="field field-name-taxonomy-vocabulary-5 field-type-taxonomy-term-reference field-label-hidden"><div class="field-items"><div class="field-item even"><a href="/tag/document-assembly">Document Assembly</a></div><div class="field-item odd"><a href="/tag/document-management">document management</a></div><div class="field-item even"><a href="/tag/content-management">content management</a></div><div class="field-item odd"><a href="/tag/openatrium">OpenAtrium</a></div><div class="field-item even"><a href="/tag/drupal">Drupal</a></div><div class="field-item odd"><a href="/tag/drupal-planet">Drupal Planet</a></div></div></div>', 1400614388, ''),
(46, 2, 'Janez Urevc: Drupal community, please meet Chandan Singh', 'http://janezurevc.name/drupal-community-please-meet-chandan-singh', '', '<div class="field field-name-body field-type-text-with-summary field-label-hidden view-mode-rss"><div class="field-items"><div class="field-item even" property="content:encoded"><p><a href="https://drupal.org/user/2828287">Chandan</a> is one of the <a href="http://drupal.org">Drupal''s</a> students that were accepted into <a href="https://en.wikipedia.org/wiki/Google_SoC">Google Summer of code</a> program this year. <a href="https://groups.drupal.org/node/423758">He wrote an introduction post</a> to say hi and explain what he''s working on.</p>\n</div></div></div>', 1400618989, ''),
(47, 2, 'Károly Négyesi: Drupal 8 security and me', 'http://www.drupal4hu.com/node/396', '', '<p>Summary: if you are working on a core patch which smells like it might be security related please <a href="https://drupal.org/user/9446/contact">let me know</a> and I will review. </p>\n<p>Meanwhile, I am working on  <a href="https://drupal.org/node/1825952">switching twig autoescape on</a>. Help is warmly appreciated, please <a href="https://drupal.org/user/9446/contact">contact me</a>.</p>\n<!--break--><!--break--><p>Long story short, as I have tried (and mostly succeeded) in vacating the core queue I found myself in a trap: while I can overlook what I perceive as architecture shortfalls in Drupal 8, as long as I remain within the Drupal ecosystem I can''t in a good conscience overlook the security holes and I can''t leave the Drupal ecosystem without seriously compromising my fiscal situation. So I am doing what I can to make sure Drupal 8 is secure and completely leave performance, developer experience and such problems to others. I am also trying to help a little with documentation as long as it''s not controversial and documentation rarely is.</p>', 1400620267, ''),
(48, 2, 'Modules Unraveled: 109 Getting Rules Ported to Drupal 8 with Josef Dabernig, Klaus Purer and Wolfgang Ziegler - Modules Unraveled Podcast', 'http://modulesunraveled.com/podcast/109-getting-rules-ported-drupal-8-josef-dabernig-klaus-purer-and-wolfgang-ziegler-modules', '', '<div class="field field-name-field-image field-type-image field-label-hidden view-mode-rss"><div class="field-items"><figure class="clearfix field-item even"><img typeof="foaf:Image" class="image-style-podcast-default" src="http://modulesunraveled.com/sites/default/files/styles/podcast_default/public/podcast/image/Dasjo%2C%20Klausi%2C%20Fago.png?itok=PuujalLX" width="350" height="118" alt="Photo of Josef Dabernig, Klaus Purer and Wolfgang Ziegler" /></figure></div></div><span class="submitted-by">Published: Wed, 05/21/14</span><div class="field field-name-field-podcast-file field-type-file field-label-hidden view-mode-rss"><div class="field-items"><div class="field-item even"><div class="mediaelement-audio"><audio  src="http://traffic.libsyn.com/modulesunraveled/109_Getting_Rules_Ported_to_Drupal_8_with_Josef_Dabernig_Klaus_Purer_and_Wolfgang_Ziegler_-_Modules_Unraveled_Podcast.mp3" class="mediaelement-formatter-identifier-1400651691-0" controls="controls" ></audio><div class="mediaelement-download-link"><a href="http://traffic.libsyn.com/modulesunraveled/109_Getting_Rules_Ported_to_Drupal_8_with_Josef_Dabernig_Klaus_Purer_and_Wolfgang_Ziegler_-_Modules_Unraveled_Podcast.mp3">Download this episode</a></div></div></div></div></div><div class="field field-name-body field-type-text-with-summary field-label-hidden view-mode-rss"><div class="field-items"><div class="field-item even" property="content:encoded"><h2>Rules</h2>\n<ul><li>\n<p>For those new to Drupal, what is the Rules module?</p>\n<ul><li>Intro Rules: events, conditions, actions</li>\n<li>Programming for site builders</li>\n<li>Giving workflows into the hands of the site builders, workflow building blocks like Lego</li>\n</ul><p>The Rules module allows site administrators to define conditionally executed actions based on occurring events (known as reactive or ECA rules).</p>\n</li>\n</ul><p>Example use cases<br />\nBuild flexible content publishing workflows changes<br />\nSend customized mails to notify your users about important updates<br />\nCreate custom redirections, system messages, breadcrumbs, ...<br />\nBuild an e-commerce store using Drupal Commerce<br />\nAnd many more…</p>\n<p>Rules has fantastic integration with Drupal Core APIs and all structured data exposed using the Entity and Fields systems, over 350 other contributed modules specifically integrate with the Rules API by to provide their own custom events, conditions, actions or exposing custom data in a reusable way.</p>\n<p>Use case: Automating processes<br />\nRules serves the need for automating processes like comment moderation, customizable e-mail notifications or event-based calculations on social platforms. These are built by using generic tools like Flag, Organic groups and message module. More specific solutions like Privatemsg, Feeds, Activity, User point or Voting rules also tightly integrate into the system.</p>\n<p>What is the Rules module, explain some use cases &amp; tell us about the rules success story<br />\nhttp://d8rules.org/content/rules-success-story</p>\n<h2>Drupal 8</h2>\n<ul><li>In the last episode, Crell mentioned that because of the advances in D8, there may not be a need for the Rules module. So, I told him that I would ask you guys for a response to that.</li>\n<li>What Drupal 8 Stuff are you building upon?</li>\n</ul><p>Entity API<br />\nOut-of-the-box typed data support for all fields, i.e. including custom content entity types</p>\n<p>Typed Data API</p>\n<p>The Typed Data API was created to provide developers with a consistent way of interacting with data in different ways. Not only does the API allow you to interact with the actual data, it also provides means of fetching more information, or metadata, about the actual data.<br />\nThe Typed Data API is a low level, generic and reusable object oriented API. One API that implements it is the Entity API - Drupal’s primary data model.</p>\n<p>-&gt; Unification of metadata systems of Drupal 7.</p>\n<p>Conditions &amp; Actions</p>\n<p>We''ve got an Actions and Conditions API in core already, so one might think another huge part has been taken care off. Unfortunately, no - those APIs have been created/ported with other use cases in mind, so they do not cater for all the more advanced features Rules users are used to.</p>\n<p>While I tried to make sure they fit Rules needs as far as possible when they were introduced/updated, they do not fit our needs yet and it might be impossible to make them fit without breaking those APIs. For Rules 8.x we plan to work on improving those APIs (from contrib) as needed first, so we can ensure they fit Rules'' requirements.</p>\n<p>Once we are sure everything works out we''ll know what we have to adapt and whether improvements can be contributed to core.<br />\nDepending on how that works out, we''ll see whether we can build up on the core Action and Conditions API or there will be Rules'' variants of those APIs (again :(). For more details please see the related issues:</p>\n<p>Rules 8.x Architecture<br />\nRules 8.x Roadmap</p>\n<p>Motivation behind Rules in Drupal 8</p>\n<p>Features<br />\nhttp://d8rules.org/content/overview-rules-8x-features</p>\n<p>Porting Rules to Drupal 8 will require a major refactoring of the framework. The Rules Core APIs &amp; functionality will evolve and Drupal 8 rewrite opportunities will be taken into account.</p>\n<p>Site building based on Drupal 8 core integration wins<br />\nAdmin UI usability improvements<br />\nSimple Views Bulk operations in core</p>\n<p>Reusable components<br />\nPlug-in based architecture &amp; fully object-oriented code<br />\nRules data selector for tokens, contexts and other use cases<br />\nTyped data widgets &amp; formatters<br />\nEmbeddable Rules UI components to integrate actions &amp; conditions</p>\n<p>Evolved developer experience<br />\nUnified DX based on Drupal 8 plug-in system<br />\nSymfony 2 event system integration<br />\nDeployable config via CMI</p>\n<p>Funding, milestones, Corporate &amp; crowdfunding  - how will that work out?<br />\nhttp://test-d8rules.gotpantheon.com/content/funding-goal-project-milestones<br />\n- sponsorship by company<br />\n- crowd funding<br />\n- What happens if the funding does not succeed?</p>\n<p>How &amp; who<br />\nhttp://test-d8rules.gotpantheon.com/team<br />\n- fago, klausi, dasjo, nico</p>\n<p>crowd funding is live now - drupalfund.us!!!</p>\n<p>Who supports you already?<br />\nsee http://d8rules.org/supporters</p>\n<p>Why should we help now?</p>\n<h2>Questions from Twitter</h2>\n<ul><li><a href="http://twitter.com/rteijeiro">Ruben Teijeiro</a><br />\nWhen Rules in #Drupal Core? #MUP109 <a href="http://twitter.com/d8rules">d8rules</a></li>\n</ul></div></div></div><section class="field field-name-field-items-mentioned field-type-link-field field-label-above view-mode-rss"><h2 class="field-label">Episode Links:&nbsp;</h2><div class="field-items"><div class="field-item even"><a href="http://drupal.org/user/16747" target="_blank" rel="nofollow">fago on drupal.org</a></div><div class="field-item odd"><a href="https://twitter.com/the_real_fago" target="_blank" rel="nofollow">fago on Twitter</a></div><div class="field-item even"><a href="https://drupal.org/user/262198" target="_blank" rel="nofollow">klausi on drupal.org</a></div><div class="field-item odd"><a href="http://twitter.com/_klausi_" target="_blank" rel="nofollow">klausi on Twitter</a></div><div class="field-item even"><a href="https://drupal.org/user/228295" target="_blank" rel="nofollow">Dasjo on drupal.org</a></div><div class="field-item odd"><a href="http://twitter.com/dasjo" target="_blank" rel="nofollow">Dasjo on Twitter</a></div><div class="field-item even"><a href="http://d8rules.org" target="_blank" rel="nofollow">d8rules.org</a></div><div class="field-item odd"><a href="https://www.drupalfund.us/project/d8rules-support-rules-module-drupal-8" target="_blank" rel="nofollow">DrupalFund.us Crowdfunding Campaign</a></div><div class="field-item even"><a href="http://klau.si" target="_blank" rel="nofollow">Klausi’s Blog</a></div><div class="field-item odd"><a href="http://drunomics.com/en/blog/d8rules-supporting-rules-modules-drupal-8" target="_blank" rel="nofollow">Blog post about Supporting Rules in D8</a></div><div class="field-item even"><a href="http://d8rules.org/team" target="_blank" rel="nofollow">d8rules Team</a></div></div></section><section class="field field-name-field-tags field-type-taxonomy-term-reference field-label-above view-mode-rss"><h2 class="field-label">Tags:&nbsp;</h2><ul class="field-items"><li class="field-item even"><a href="/planet-drupal" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">planet-drupal</a></li></ul></section>', 1400648400, ''),
(49, 2, 'Oliver Davies: git format-patch is your Friend', 'http://www.oliverdavies.co.uk/planet.xml', '', 'The ProblemAs an active contributor to the Drupal project, I spend a lot of time working with other peoples’ modules and themes, and occassionally have to fix a bug or add some new functionality.In the Drupal community, we use a patch based workflow where any changes that I make get exported to a file detailing the differences. The patch file (*.patch) is attached to an item in an issue queue on Drupal.org, applied by the maintainer to their local copy of the code and reviewed, and hopefully committed.', 1400655600, ''),
(50, 2, 'Oliver Davies: git format-patch is your Friend', 'http://www.oliverdavies.co.uk/blog/2014/05/21/git-format-patch/', '', '<h2 id="the-problem">The Problem</h2>\n\n<p>As an active contributor to the <a href="http://drupal.org">Drupal</a> project, I spend a lot of time working with other peoples’ modules and themes, and occassionally have to fix a bug or add some new functionality.</p>\n\n<p>In the Drupal community, we use a patch based workflow where any changes that I make get exported to a file detailing the differences. The patch file (*.patch) is attached to an item in an issue queue on Drupal.org, applied by the maintainer to their local copy of the code and reviewed, and hopefully committed.</p>', 1400655600, ''),
(51, 2, 'Code Enigma: Drupal 6 Performance Testing', 'http://www.codeenigma.com/en/blog/drupal-6-performance-testing', '', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even" property="content:encoded"><p>We were recently asked to investigate poor performance on a Drupal 6 site. Memcache was enabled, but a <a href="http://www.joedog.org/siege-home/">siege</a> test was still showing poor results.</p>\n<pre class="brush:plain;">\nTransactions:		         145 hits\nAvailability:		      100.00 %\nElapsed time:		      525.34 secs\nData transferred:	        1.89 MB\nResponse time:		       17.08 secs\nTransaction rate:	        0.28 trans/sec\nThroughput:		        0.00 MB/sec\nConcurrency:		        4.71\nSuccessful transactions:         145\nFailed transactions:	           0\nLongest transaction:	       28.38\nShortest transaction:	       13.03</pre><p>We run <a href="http://newrelic.com/">New Relic</a> for performance testing and the siege traffic gives it plenty to analyse.</p>\n<p>The first thing we noticed in New Relic was that there were some slow hook_init functions being called. The worst performing of these was in the Password Policy module, covered at <a href="http://drupal.org/node/2008282">http://drupal.org/node/2008282</a>. Fixing this didn''t make a huge change to the performance though.</p>\n<p>The site also runs CiviCRM and in the New Relic transactions, it showed that civicrm_invoke was taking a long time to process. Digging into the transaction details, we came across this:</p>\n<p><img alt="" height="487" src="http://www.codeenigma.com/sites/default/files/NewRelic_theme_build_registry_0.png" width="610" /></p>\n<p>The theme registry was being rebuilt on every page load. We checked to see if there were any theme settings that had been left enabled from development that were causing the theme rebuild, but found none.</p>\n<p>Checking through the functions that appeared in the transaction log, the only reason for the theme registry to be rebuilt each time that we could come up with was that it was failing to be saved in the cache. The log shows that <a href="http://api.drupal.org/api/drupal/includes%21theme.inc/function/_theme_load_registry/6">_theme_load_registry()</a> is called, it checks memcache for the cached theme registry, but then rebuilds it.</p>\n<pre class="brush:php;">\nfunction _theme_load_registry($theme, $base_theme = NULL, $theme_engine = NULL) {\n  // Check the theme registry cache; if it exists, use it.\n  $cache = cache_get("theme_registry:$theme-&gt;name", ''cache'');\n  if (isset($cache-&gt;data)) {\n    $registry = $cache-&gt;data;\n  }\n  else {\n    // If not, build one and cache it.\n    $registry = _theme_build_registry($theme, $base_theme, $theme_engine);\n    _theme_save_registry($theme, $registry);\n  }\n  _theme_set_registry($registry);\n}</pre><p>Checking all the logs failed to show any errors relating to memcache. For a quick check, we decided to try moving the cache table (where the theme registry is cached) out of memcache, back into the Drupal database. In settings.php, this was done by changing</p>\n<pre class="brush:plain;">\n$conf[''memcache_bins''] = array(\n    ''cache'' =&gt; ''default'',\n    ...</pre><p>to</p>\n<pre class="brush:plain;">\n$conf[''memcache_bins''] = array(\n    ''cache'' =&gt; ''database'',\n    ...</pre><p>Running the siege test again showed a marked improvement.</p>\n<pre class="brush:plain;">\nTransactions:		         112 hits\nAvailability:		      100.00 %\nElapsed time:		       97.70 secs\nData transferred:	        1.46 MB\nResponse time:		        3.83 secs\nTransaction rate:	        1.15 trans/sec\nThroughput:		        0.01 MB/sec\nConcurrency:		        4.39\nSuccessful transactions:         112\nFailed transactions:	           0\nLongest transaction:	        5.92\nShortest transaction:	        2.80</pre><p>That seemed conclusive, but didn''t help to understand why memcache was failing to store the theme registry. Further investigation led us to <a href="http://drupal.org/node/435694">http://drupal.org/node/435694</a>. Memcache will only store data up to 1M in size - not only that, but it fails silently, so nothing appears in the logs.</p>\n<p>There are patches in <a href="http://drupal.org/node/435694">http://drupal.org/node/435694</a> to add logging to capture these memcache failed saves and there''s also a php snippet at <a href="http://gist.github.com/typhonius/8798894">http://gist.github.com/typhonius/8798894</a> to scan all the Drupal cache tables and highlight any objects over 1M in size.</p>\n<p>If you''re using memcache 1.4.2 or later, you can increase the 1M maximum object size, see <a href="https://code.google.com/p/memcached/wiki/ReleaseNotes142">https://code.google.com/p/memcached/wiki/ReleaseNotes142</a> for example, but increasing this too much may impact memcache''s efficiency.</p>\n<p>New Relic certainly made it much quicker for us to diagnose the underlying issue though and having the near instant feedback is great.</p>\n</div></div></div><div class="field field-name-field-blog-service-areas field-type-node-reference field-label-above"><div class="field-label">Related Service Areas:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/en/consultancy">Consultancy</a></div><div class="field-item odd"><a href="/en/development">Development</a></div><div class="field-item even"><a href="/en/support">Support</a></div></div></div><div class="field field-name-field-blog-intro field-type-text-long field-label-above"><div class="field-label">Teaser:&nbsp;</div><div class="field-items"><div class="field-item even">A scenario where memcache can actually impair performance</div></div></div><div class="field field-name-field-blog-categories field-type-taxonomy-term-reference field-label-above"><div class="field-label">Categories:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/en/category/consultancy" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">Consultancy</a></div><div class="field-item odd"><a href="/en/category/development" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">Development</a></div><div class="field-item even"><a href="/en/category/drupal-planet" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">Drupal Planet</a></div><div class="field-item odd"><a href="/en/category/support" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">Support</a></div></div></div><div class="field field-name-field-blog-primary-category field-type-taxonomy-term-reference field-label-above"><div class="field-label">Primary Category:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/en/category/consultancy" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">Consultancy</a></div></div></div>', 1400669165, ''),
(52, 2, 'Acquia: Ultimate Guide to Drupal 8: Episode 3 - Site builder Improvements', 'https://www.acquia.com/blog/ultimate-guide-drupal-8-episode-3-site-builder-improvements', '', '<div class="field field-name-body field-type-text-with-summary field-label-hidden">\n    <div class="field-items">\n          <div property="content:encoded" class="field-item even"><p>Welcome to the third instalment of an 8-part blog series we''re calling "<a href="/tags/ultimate-guide-drupal-8">The Ultimate Guide to Drupal 8</a>." Whether you''re a site builder, module or theme developer, or simply an end-user of a Drupal website, Drupal 8 has tons in store for you! This blog series will attempt to enumerate the major changes in Drupal 8. Successive posts will gradually get more technical, so feel free to skip to later parts (once they''re published) if you''re more on the geeky side.</p></div>\n      </div>\n</div>\n<span property="dc:title" content="Ultimate Guide to Drupal 8: Episode 3 - Site builder Improvements" class="rdf-meta"></span>', 1400671981, ''),
(53, 2, 'Code Karate: Using Views with the Entity Reference module in Drupal 7', 'http://codekarate.com/daily-dose-of-drupal/using-views-entity-reference-module-drupal-7', '', '<div class="field field-name-field-ddod-video field-type-file field-label-hidden"><div class="field-items"><div class="field-item even"><img src="http://codekarate.com/sites/default/files/styles/large/public/media-youtube/4Pdii7aFIvc.jpg?itok=03PbDLv7" alt="Using Views with the Entity Reference module in Drupal 7 - Daily Dose of Drupal episode 151" /></div></div></div><div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p>If you want to learn how to use Drupal 7 <a href="" rel="nofollow">Entity Reference</a> fields with the Views module you have come to the right place.</p></div></div></div>', 1400673044, ''),
(54, 2, 'Tigerfish: White House contributes APIs, stages hackathons & runs on Drupal', 'http://tiger-fish.com/blog/white-house-contributes-apis-stages-hackathons-runs-drupal', '', '<div class="field field-name-field-image field-type-image field-label-hidden"><div class="field-items"><div class="field-item even"><img src="http://tiger-fish.com/files/tigerfish/styles/blog_home/public/500px-us-whitehouse-logo.svg_.png?itok=qj_HwbcY" width="422" height="200" alt=" " /></div></div></div><div class="field field-name-field-summary field-type-text field-label-hidden"><div class="field-items"><div class="field-item even">Director of new media technologies at the Executive Office of the President of the United State of America Leigh Heyman was recently reported to be the man behind all the modern interactive media delivered during Barack Obama&#039;s last &#039;state of the union&#039; a</div></div></div><div class="field field-name-body field-type-text-with-summary field-label-hidden prose"><div class="field-items"><div class="field-item even"><p>When he''s not making sure President Obama''s "social footprint" is impressive and impactful, Heyman can be found explaining how the White House has embraced open source technologies as part of its wider remit to digitise its activities.</p><p>Heyman recently spoke at a conference in South Carolina to explain how WhiteHouse.gov has been working with more open technologies.</p><p>Most interesting of all perhaps is that this presidential IT team is now moving towards more open and transparent government with activities including:</p></div></div></div><div class="field field-name-taxonomy-vocabulary-1 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Blogs:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/3">Drupal Planet</a></div></div></div><div class="field field-name-taxonomy-vocabulary-2 field-type-taxonomy-term-reference field-label-above"><div class="field-label">Tags:&nbsp;</div><div class="field-items"><div class="field-item even"><a href="/taxonomy/term/16">Blogging</a></div></div></div>', 1400676215, ''),
(55, 2, 'Fred Parke | The Web Developer: Using the sass @for directive to generate staggered :nth-child transitions', 'http://fredparke.com/blog/using-sass-directive-generate-staggered-nth-child-transitions', '', '<div class="field field--name-field-image field--type-image field--label-hidden"><div class="field__items"><div class="field__item even"><img src="http://fredparke.com/sites/default/files/oldbrowser.gif" width="720" height="460" alt="Older browsers be damned!" /></div></div></div><div class="field field--name-body field--type-text-with-summary field--label-hidden"><div class="field__items"><div class="field__item even"><p>Older browsers be damned!</p>\n\n<p>The latest couple of Drupal websites I have worked on have been incredibly fulfilling to me as a front-end developer in that they aren''t <strong>bogging themselves down with ridiculous old browser support</strong>.</p>\n\n<p>We are using progressive enhancement of course, so these browsers still have the same functionality, but don''t get to have all the sexy flourishes. These are mostly done using CSS3, something that if your browser doesn''t support, you probably don''t deserve anyway.</p></div></div></div>', 1400680884, '');
INSERT INTO `aggregator_item` (`iid`, `fid`, `title`, `link`, `author`, `description`, `timestamp`, `guid`) VALUES
(56, 2, 'Drupal Association News: Calling All Design Firms: DrupalCon needs you', 'https://assoc.drupal.org/blog/stephaniet66/calling-all-design-firms-drupalcon-needs-you', '', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><h2>\n	 </h2>\n<p><img alt="DrupalCon on etch a sketch" class="left" src="https://assoc.drupal.org/files/drupalcon.jpg" />The Drupal Association is seeking two creative and innovative design partners to create the web and print designs for the 2015 and 2016 DrupalCon events. We’re looking for people who understand that each DrupalCon is a singular expression of the Drupal community, DrupalCon location, software innovation, and extreme nerdiness, and know how to turn this into compelling designs that are functional, fun, and make people look twice.</p>\n<p>DrupalCon events convene thousands of people from the diverse Drupal Community - including coders, site builders, content editors, business people, themers, and more. For a week, these people come together to drain a city of all its coffee and fill the void with  energy, companionship, and code unmatched by any other tech community. Part SxSW, part DreamForce, and part college dorm room, DrupalCons are a signature part of the Drupal experience.</p>\n<p><strong>Design is an important part of the DrupalCon experience. Through design, we are able to:</strong></p>\n<ul><li>\n		Showcase the community in which the DrupalCon is held, highlighting known, and not so known, gems without subverting or subjugating the Drupal identity.</li>\n	<li>\n		Illustrate the beauty of Drupal for web sites. DrupalCon web sites should push the boundaries of Drupal design.</li>\n	<li>\n		Create a sense of community connection. DrupalCon t-shirts and pins are collectors items, worn by the folks who proudly show off their participation.</li>\n</ul><h1>\n	Project Elements</h1>\n<p>DrupalCons are not small undertakings. Your designs will need to work in a variety of contexts and settings, from giant 12 foot banners to 150 pixels square web badges. Following is a comprehensive, though not exhaustive, list of elements to be delivered:</p>\n<ul><li>\n		Conference logo, web and print ready formats</li>\n	<li>\n		Coming soon! splash page (prior to official site launch)</li>\n	<li>\n		Conference web site theme (but you don’t have to build the site, we’re on that)</li>\n	<li>\n		Web badges for sponsors, attendees, and other stakeholders</li>\n	<li>\n		Social media icons and branding</li>\n	<li>\n		Newsletter banners and other digital promotion images</li>\n	<li>\n		Conference venue signage, including banners, etc.</li>\n	<li>\n		Various merchandise and branding elements</li>\n	<li>\n		Conference program guide</li>\n	<li>\n		Sponsorship guide</li>\n	<li>\n		Style guide</li>\n</ul><p><br />\n	There’s one thing you DON’T have to do: build the website. The Drupal Association will lead the development of the website from <a href="https://drupal.org/project/cod">COD</a>. Our Design Partner will be heavily involved in applying the new design to the website as a Drupal theme. Knowledge of COD and Commerce will be extremely helpful here.</p>\n<h1>\n	Requirements</h1>\n<p>We don’t want to leave you to wander the wilderness alone, so we’ll be providing lots of guidance along the way, but our goal is to stay out of your way as much as possible and let you create compelling, fun, and memorable work. That said, there are a few things you’re going to want to be prepared for:</p>\n<ul><li>\n		Working with a committee of local team members. We don’t run DrupalCons by ourselves. Our Local Team committee is going to be deeply involved in developing the identity of the conference. But don’t worry - they don’t all have to sign off on every design element.</li>\n	<li>\n		We expect extreme comfort in web and print production processes. We make a LOT of stuff for this conference, and understanding printing processes will allow you to maximize our print budget while pushing the boundaries of cool.</li>\n</ul><h1>\n	Compensation</h1>\n<p>Budget for our North America, 2015 and Europe 2015 DrupalCons are each fixed at $25,000 per event. Third Cons (Cons to be held outside of North America and Europe in locations to be determined) and 2016 Cons, depending on location, will have different budgets based on estimated event size and scope.  The design company will receive public recognition on the site via footer credits and volunteer credits, and a Bronze level booth at each event, which includes 2 tickets.</p>\n<h1>\n	Timeline</h1>\n<p>Starting in 2015, the Drupal Association will be producing 3 DrupalCons each year.  To make the process smoother, we are going to stagger our designers.  We are currently looking for designers as follows:</p>\n<ul><li>\n		Designer 1: North America, 2015 and 3rd Con to be determined in 2016</li>\n	<li>\n		Designer 2: Europe, 2015 and North America 2016</li>\n</ul><p>We expect to complete firm selection for Designer 1 by late-June And Designer 2 by mid-July. We intend to conduct a selection process that is better suited to engage and evaluate the relative merits of creative professionals. Firms that intend to bid on this project should state their intent to bid (contact info below). We will then schedule a presentation, where our team can get a sense of you, your process, and your portfolio. A round of Q&amp;A follows, leading to our selection process, after which we will announce selections. Then, we’ll work on a final round of negotiations and a contract. If your firm is not selected we will take the time to explain why.</p>\n<p><strong>Firms that intend to bid should email Stephanie Torres (contact information below) no later than Friday, June 13, 5pm PST.</strong></p>\n<h1>\n	Contact Information</h1>\n<p>Stephanie Torres (<a href="mailto:storres@association.drupal.org?subject=DrupalCon%20Design">email</a>)<br />\n	Community Program Manager, Drupal Association<br />\n	+1 503-915-9073</p>\n</div></div></div>', 1400687917, ''),
(57, 2, 'Palantir: Palantir @ DrupalCon Austin', 'http://www.palantir.net/blog/palantir-drupalcon-austin', '', '<span class="featured-blog-image">  \n      <img typeof="foaf:Image" src="http://www.palantir.net/sites/default/files/styles/bloglandingpage-thumbnail/public/blog/images/8774297538_24f304aaa5_o.jpg?itok=feoEg6Gk" width="262" height="175" alt="DrupalCon - photo: Michael Schmid - CC BY-SA 2.0" title="DrupalCon - photo: Michael Schmid - CC BY-SA 2.0" />  </span>\n            <p>It’s that time of year again: DrupalCon in the US! We’ll be headed to the great state of Texas – Austin, specifically – and we’re incredibly excited to get things rolling. Why? It’s the sharing of ideas, the culture, the community, and the fun – it’s like an enormous think-tank filled with like-minded, interesting individuals, from which new methods emerge and inspiration flows. Will you be there? Let us know <a href="http://palantir.net/contact">via email</a> or on <a href="http://twitter.com/palantir">Twitter</a>, or in the comments.</p>\n<p>We’ve set up shop at <strong>booth 215</strong>, across from the Drupal Association and the Commerce Village (and right near one of the main coffee stations, thankfully). We hope you stop by and say hello, grab a button and sticker, play a little <em>Palantrivia</em> while you sip on a coffee, and hang out with the Palantiri that will inevitably be congregating at our booth throughout the week.</p>\n<p>If we don’t catch you on the show floor for some odd reason, we do hope to see you during post-con hours – <strong>like at <a href="https://austin2014.drupal.org/trivia-night">Trivia Night</a></strong>, of which Palantir is a proud sponsor!</p>\n<p>Of course, let’s not forget the point of DrupalCon: sharing and learning. To this end, we have 11 <a href="http://palantir.net/about">Palantiri</a> headed to the Con this year, some of whom are leading sessions. Here’s who’s going, and a rundown of sessions of interest: Sean Buscay, Kelsey Bentham, George DeMet, Larry “Crell” Garfield, Tom Jones, Steve Persch, Ken Rickard, Shawn Smith, Andrea Soper, Ryan Wagner, and Chris Zietlow.</p>\n<p></p>\n<h3>Larry Garfield</h3>\n<ul><li><a href="https://austin2014.drupal.org/session/functional-php">Functional PHP - Tuesday 2:15-3:15pm - Room: F - Blackmesh - 4th floor</a></li>\n<li><a href="https://austin2014.drupal.org/session/deims-drupal-profile-ecological-data">DEIMS, a Drupal Profile for Ecological Data - Thursday 1:00-2:00pm - Room: 16 - Pantheon - 4th floor</a></li>\n<li><a href="https://austin2014.drupal.org/session/road-81">The Road to 8.1 - Wednesday 10:45-11:45am - Room: 15 - Commerce Guys - 4th floor</a></li>\n<li>And maybe more sessions if he has any…openings.</li>\n</ul><p></p>\n<h3>Ken Rickard</h3>\n<ul><li><a href="https://austin2014.drupal.org/session/deims-drupal-profile-ecological-data">DEIMS, a Drupal Profile for Ecological Data - Thursday, June 5th 1:00-2:00pm - Room: 16 - Pantheon - 4th floor</a></li>\n</ul><p></p>\n<h3>Sean Buscay</h3>\n<ul><li><a href="https://austin2014.drupal.org/session/deims-drupal-profile-ecological-data">DEIMS, a Drupal Profile for Ecological Data - Thursday, June 5th 1:00-2:00pm - Room: 16 - Pantheon - 4th floor</a></li>\n</ul><p></p>\n<h3>Andrea Soper</h3>\n<ul><li><a href="https://austin2014.drupal.org/get-involved-with-core">Leading the Sprint: Get Involved with Core - Friday, June 6 9:00am-6:00pm - Room: F - Blackmesh - 4th floor</a></li>\n</ul><p></p>\n<h3>Steve Persch <span>is looking forward to…</span></h3>\n<ul><li><a href="https://austin2014.drupal.org/session/markup-aint-easy-or-how-i-learned-love-object-oriented-renderapi">Markup Ain''t Easy or: How I Learned to Love an Object-oriented Render API - Wednesday June 4th 1:00-02:00pm - Room: 15 - Commerce Guys - 4th floor</a></li>\n<li><a href="https://austin2014.drupal.org/session/twig-dead-long-live-web-components">Twig is Dead. Long Live Web Components! - Thursday June 5th 1:00-02:00pm - Room: 15 - Commerce Guys - 4th floor</a></li>\n</ul><p>We’re also quite proud to be Gold Level sponsors of the conference this year, in addition to sponsoring the aforementioned, mind-bending <a href="https://austin2014.drupal.org/trivia-night">Trivia Night</a>. We hope to see you around the convention and beyond.</p>\n<p>What are you excited for at DrupalCon this year? Let us know in the comments.</p>\n<p><em>photo: Michael Schmid - CC BY-SA 2.0</em></p>', 1400693912, ''),
(58, 2, 'AGLOBALWAY: Colour contrast for accessibility: making your site readable', 'http://www.aglobalway.com/content/colour-contrast-accessibility-making-your-site-readable', '', '<div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even" property="content:encoded"> <p>One of the trends in minimalist web design is to choose fonts and colours that are small thin, or light. Understandably, this makes for a clean look and adds subtlety to your design. Despite the visual appeal, this approach can create some problems with accessibility.</p>\n<p>As part of the small (though not insignificant) segment of the population that is colour-blind, I have particular difficulty reading text styled in this manner. The <a href="http://www.w3.org/TR/2014/NOTE-WCAG20-TECHS-20140408/G18">WCAG Standard</a> describes the minimum contrast ratio for text that is less than 18 point (if not bold) and less than 14 point (if bold) as 4.5:1. The linked above provides some example scenarios and technique suggestions for ensuring that this contrast ratio can be achieved, as well as some resources to guide you in your development.</p>\n<p>One thing that is easy to do is to when developing your site is to disable images using Firefox developer tools (or something similar), and see what your text looks like. Often we will have white text on a dark background - but if that background image disappears the text can be impossible to read. Simply adding a background colour to your text to match your image colour can prevent this from being an issue when images are turned off. Other methods like shadows or similar effects can also help to achieve readability.</p>\n<p>Remember, keep your text at a readable size (no more tiny text!), and turn up the contrast. Many people have visual impairments of some form or another, and we want everyone to be able to read our content.</p>\n<p><strong>Bonus</strong>: if you enjoy playing around while you work, <a href="http://leaverou.github.io/contrast-ratio/">this</a> is one of my favourite tools for checking your colour contrast.</p>\n </div></div></div><div class="field field-name-field-tags field-type-taxonomy-term-reference field-label-above"><div class="field-label">Tags:&nbsp;</div><div class="field-items"><div class="field-item even" rel="dc:subject"><a href="/tags/drupal" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">drupal</a></div><div class="field-item odd" rel="dc:subject"><a href="/tags/drupal-planet" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">drupal planet</a></div></div></div>', 1400696437, ''),
(59, 2, 'OpenConcept: Translating user-entered strings in D7', 'https://openconcept.ca/blog/matt/translating-user-entered-strings-d7', '', '<div class="field field-name-body field-type-text-with-summary field-label-hidden view-mode-fulltext"><div class="field-items"><div class="field-item even"><p>The <a href="https://drupal.org/project/i18n">Internationalization suite of modules</a> do a pretty good job of making everything translatable in Drupal 7. But, if you''re writing a module that stores its data outside variables or entities, you might notice a few gaps.</p>\n<p>On a recent project, I noticed that field display settings (<a href="https://api.drupal.org/api/drupal/modules!field_ui!field_ui.api.php/function/hook_field_formatter_settings_form/7">field formatter settings</a> for those familiar with the <a href="https://drupal.org/node/443536">Field API</a>) are not translatable by default. In many cases, this is fine because the field settings in core modules don''t make sense to translate: for example, the number of characters to trim a summary at or the image style to use.</p>\n<!--break--><h2>Never use <tt>t($user_entered_string)</tt>!</h2>\n<p>It''s tempting to solve this problem by passing the variable through <tt>t()</tt> as you''re outputting it (e.g.: <tt>$label = t($settings[''label''])</tt>), however doing so is a bad idea!</p>\n<h3>Why <tt>t($variable)</tt> is usually a bad idea</h3>\n<p>To quote <a href="https://api.drupal.org/api/drupal/includes!bootstrap.inc/function/t/7">the documentation for the <tt>t()</tt> function</a>,</p>\n<blockquote><p>You should never use t() to translate variables, such as calling</p>\n<p><tt><br />\nt($text);<br />\n</tt>\n</p></blockquote>\n<p>There are a few reasons for this:</p>\n<ul>\n<li>\n<p>In addition to actually translating text at run-time, the <tt>t()</tt> function is also used by text-extraction routines to find text that needs to be translated, and build databases of text to be translated for translation teams.</p>\n<p>Both the Internationalization''s built-in string translator and the <a href="https://drupal.org/project/potx">Translation template extractor</a> module (which powers <a href="https://localize.drupal.org/">the Drupal Translations site</a>) ignore calls to <tt>t()</tt>, whose first argument contains any variable (e.g.: <tt>t($var)</tt>, <tt>t($var . ''text'')</tt>, etc.): these won''t even show up as being available to translate!</p>\n</li>\n<li>The <tt>t()</tt> system doesn''t support updates to existing strings. When user data is updated, the next time it''s passed through <tt>t()</tt>, <em>a new record is created</em> instead of an update. The database bloats over time and any existing translations are orphaned with each update.</li>\n<li>The <tt>t()</tt> system assumes any data it receives is in English. User data may be in another language, producing translation errors.</li>\n</ul>\n<p>The only case in which variables can be passed safely through <tt>t()</tt> is when the string in the variable will be passed through <tt>t()</tt> elsewhere.</p>\n<h3>Why <tt>t($user_entered_string)</tt> is a security risk</h3>\n<p>To quote the <tt>t()</tt> function documentation again,</p>\n<blockquote><p>It is especially important never to call</p>\n<p><tt><br />\nt($user_text);<br />\n</tt></p>\n<p>, where $user_text is some text that a user entered - doing that can lead to cross-site scripting and other security problems.</p>\n</blockquote>\n<p>For example, a malicious translator could enter HTML in their translations (a <a href="https://en.wikipedia.org/wiki/Cross-site_scripting">cross-site scripting (XSS)</a> attack).</p>\n<h2>Introducing <tt>i18n_string()</tt></h2>\n<p>So, what is a module developer to do? As it turns out, the <a href="https://drupal.org/project/i18n">Internationalization project</a>''s <em>String translation</em> sub-module (<tt>i18n_string</tt>) has a function named <a href="http://drupalcontrib.org/api/drupal/contributions!i18n!i18n.module/function/i18n_string/7"><tt>i18n_string()</tt></a>, which makes it easy to store and retrieve translations of user-entered strings with only minimal changes to your module.</p>\n<h3>Remembering your keys</h3>\n<p>To ensure strings get updated, not orphaned, <tt>i18n_string()</tt> requires a <tt>$key</tt> parameter that uniquely identifies that instance of the string to store and load the string.</p>\n<p>For example, if the string is always displayed the same way, a simple key will suffice (like a <a href="https://api.drupal.org/api/drupal/includes!bootstrap.inc/function/variable_set/7">variable name</a>). However, if the string has variants, like a block title (each block could have a different title) or a field formatter setting (each content type could have different settings for each of its display modes; and there could be more than one field of that type in a content type), you''ll want to construct the key from the identifiers that make that variant unique (e.g.: blocks are uniquely identified by module and delta; field formatter settings are uniquely identified by entity, bundle, view mode and field name).</p>\n<h3>Registering and translating strings</h3>\n<p>The <tt>i18n_string()</tt> function has two operations: registering a user-entered string when it''s saved (this is referred to as <em>updating</em> the string in the API) and translating (retrieving) the string when it''s displayed.</p>\n<p>To register a string, call:</p>\n<div class="codeblock geshifilter"><code><span style="color: #000000"><span style="color: #0000BB">&lt;?php<br />i18n_string</span><span style="color: #007700">(</span><span style="color: #0000BB">$key</span><span style="color: #007700">, </span><span style="color: #0000BB">$value</span><span style="color: #007700">, array(</span><span style="color: #DD0000">''update'' </span><span style="color: #007700">=&gt; </span><span style="color: #0000BB">TRUE</span><span style="color: #007700">));<br /></span><span style="color: #0000BB">?&gt;</span></span></code></div>\n<p>... where <tt>$value</tt> is whatever the user entered. Note you should still store <tt>$value</tt> somewhere so you can provide a default if the user doesn''t have <tt>i18n</tt> installed (more about this later).</p>\n<p>Note that it''s really easy to insert this call into your existing code: you don''t have to change the way your module already stores / retrieves the setting.</p>\n<p>To translate a string, call:</p>\n<div class="codeblock geshifilter"><code><span style="color: #000000"><span style="color: #0000BB">&lt;?php<br />$string_to_display </span><span style="color: #007700">= </span><span style="color: #0000BB">i18n_string</span><span style="color: #007700">(</span><span style="color: #0000BB">$key</span><span style="color: #007700">, </span><span style="color: #0000BB">$value</span><span style="color: #007700">);<br /></span><span style="color: #0000BB">?&gt;</span></span></code></div>\n<p>... where <tt>$value</tt> is whatever the user saved earlier. As with any user-entered string, make sure you''ve <a href="https://api.drupal.org/api/drupal/includes!bootstrap.inc/function/check_plain/7"><tt>check_plain()</tt></a>ed or <a href="https://api.drupal.org/api/drupal/includes!common.inc/function/filter_xss/7"><tt>filter_xss()</tt></a>ed it</p>\n<p>Again, note that it''s really easy to insert this call into your existing code.</p>\n<h3>Best practices</h3>\n<p>Currently, the <tt>i18n_string()</tt> function isn''t part of D7 core (although it exists in the form of <a href="http://hojtsy.hu/blog/2014-may-19/drupal-8-multilingual-tidbits-15-configuration-translation-basics">translatable configuration</a> in D8 core), you have to ensure <tt>i18n_string()</tt> is available before you call it, otherwise you''ll get "Call to undefined function" errors.</p>\n<p>The documentation on <a href="https://drupal.org/node/1114010">using the i18n API from other modules</a> suggests wrapping calls to it in functions which check if the function has been defined and calls it if it does (or acts as if nothing happened if it doesn''t exist):</p>\n<div class="codeblock geshifilter"><code><span style="color: #000000"><span style="color: #0000BB">&lt;?php<br /></span><span style="color: #007700">function </span><span style="color: #0000BB">_mymodule_translate</span><span style="color: #007700">(</span><span style="color: #0000BB">$name</span><span style="color: #007700">, </span><span style="color: #0000BB">$string</span><span style="color: #007700">, </span><span style="color: #0000BB">$langcode </span><span style="color: #007700">= </span><span style="color: #0000BB">NULL</span><span style="color: #007700">) {<br /> return </span><span style="color: #0000BB">function_exists</span><span style="color: #007700">(</span><span style="color: #DD0000">''i18n_string''</span><span style="color: #007700">) ? </span><span style="color: #0000BB">i18n_string</span><span style="color: #007700">(</span><span style="color: #0000BB">$name</span><span style="color: #007700">, </span><span style="color: #0000BB">$string</span><span style="color: #007700">, array(</span><span style="color: #DD0000">''langcode'' </span><span style="color: #007700">=&gt; </span><span style="color: #0000BB">$langcode</span><span style="color: #007700">)) : </span><span style="color: #0000BB">$string</span><span style="color: #007700">;<br />}</p>\n<p>function </span><span style="color: #0000BB">_mymodule_translate_update</span><span style="color: #007700">(</span><span style="color: #0000BB">$name</span><span style="color: #007700">, </span><span style="color: #0000BB">$string</span><span style="color: #007700">, </span><span style="color: #0000BB">$langcode </span><span style="color: #007700">= </span><span style="color: #0000BB">NULL</span><span style="color: #007700">) {<br /> return </span><span style="color: #0000BB">function_exists</span><span style="color: #007700">(</span><span style="color: #DD0000">''i18n_string''</span><span style="color: #007700">) ? </span><span style="color: #0000BB">i18n_string</span><span style="color: #007700">(</span><span style="color: #0000BB">$name</span><span style="color: #007700">, </span><span style="color: #0000BB">$string</span><span style="color: #007700">, array(</span><span style="color: #DD0000">''update'' </span><span style="color: #007700">=&gt; </span><span style="color: #0000BB">TRUE</span><span style="color: #007700">, </span><span style="color: #DD0000">''langcode'' </span><span style="color: #007700">=&gt; </span><span style="color: #0000BB">$langcode</span><span style="color: #007700">)) : </span><span style="color: #0000BB">FALSE</span><span style="color: #007700">;<br />}<br /></span><span style="color: #0000BB">?&gt;</span></span></code></div>\n<p>Note that the <em>translate</em> function above returns its <tt>$string</tt> parameter if <tt>i18n_string()</tt> isn''t available.</p>\n<h2>Conclusion</h2>\n<p>The <tt>i18n_string()</tt> function makes it easy to bolt translation on to existing code without changing the way your module works.</p>\n<p>If you want to see an example of how I solved the field display setting translation problem for the <a href="https://drupal.org/project/registration">Entity registration module</a>, you can see my patch at <a href="https://drupal.org/node/2234915">#2234915: Registration link text (field formatter label) is not translatable</a>.</p>\n</div></div></div><section class="field field-name-field-portfolio-topic field-type-taxonomy-term-reference field-label-above view-mode-fulltext"><h2 class="field-label">Topic:&nbsp;</h2><ul class="field-items"><li class="field-item even"><a href="/topic/custom-functionality">Custom Functionality</a></li><li class="field-item odd"><a href="/topic/multilingual">Multilingual</a></li><li class="field-item even"><a href="/topic/planet">Planet</a></li><li class="field-item odd"><a href="/topic/security">Security</a></li></ul></section><section class="field field-name-field-taxonomy-services field-type-taxonomy-term-reference field-label-above view-mode-fulltext"><h2 class="field-label">Services:&nbsp;</h2><ul class="field-items"><li class="field-item even"><a href="/services/drupal-development">Drupal Development</a></li><li class="field-item odd"><a href="/services/multilingual-web-development">Multilingual Web Development</a></li></ul></section>', 1400700600, ''),
(60, 2, 'Gizra.com: How to have lunch without speaking Drupal', 'http://www.gizra.com/content/how-to-have-lunch-without-speaking-drupal', '', '<p>Oh no, It’s lunch time!<br>\nI wonder if I’ll have anything to contribute to the conversation today. Will lunch today - like yesterday or the day before that - revolve around pull requests, Organic groups, migrate, scrum, code reviews, modules. Boring.<br>\nIf you share the same feeling reading the above lines, this blog post if for you.</p>\n\n<div class="thumbnail">\n  <img src="/assets/images/posts/lunch/photo1.jpg" />\n  <div class="caption">Geeks having a spontaneous reaction to a new version of a Drupal module. I love those guys!</div>\n</div>\n\n<p>Don’t get me wrong - I love my job and I love my co-workers as well. It’s just that every time they talk about these things it makes me wanna stand up on our designer kitchen chair and shout:<br>\n<strong>My name is Orit and I am not a Drupal geek!</strong></p>\n\n<p>I have never developed any module in my life, didn&#39;t contribute anything to OG nor have I never requested Brice or Amitai to give me a scrutinizing code review. So here are some tips:</p>\n\n          <p><a href="http://www.gizra.com/content/how-to-have-lunch-without-speaking-drupal/">Continue reading…</a></p>', 1400742000, '');
