INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<a class="twitter-timeline" href="https://twitter.com/gobinathm/lists/drupaler" data-widget-id="469504560814227456">Tweets from https://twitter.com/gobinathm/lists/drupaler</a>\r\n<script>!function(d,s,id){var js,fjs=d.getElementsByTagName(s)[0],p=/^http:/.test(d.location)?''http'':''https'';if(!d.getElementById(id)){js=d.createElement(s);js.id=id;js.src=p+"://platform.twitter.com/widgets.js";fjs.parentNode.insertBefore(js,fjs);}}(document,"script","twitter-wjs");</script>\r\n', 'Twitter updates', 'full_html'),
(2, '<a href="contact">Address</a>\r\nIRC-Channel : #drupal<br>\r\nTwitter : @drupal<br>\r\n\r\n<a href="contact">Phone</a>\r\nOops ... We don''t have one !!', 'Contact', 'full_html'),
(3, '<p>Drupal is a <a href="http://drupal.com/trademark" rel="nofollow">registered trademark</a> of <a href="http://buytaert.net" rel="nofollow">Dries Buytaert</a>.</p>', 'Footer message', 'full_html'),
(5, '<div class="testimonial">\r\n<div class="testimonial-inner">\r\n“Use Drupal to build everything from personal blogs to enterprise applications. Thousands of add-on modules and designs let you build any site you can imagine. Join us!.”\r\n</div>\r\n</div>', 'Why Choose Drupal?', 'full_html'),
(6, '<ul class="social-bookmarks">\r\n<li class="label">Connect with us:</li>\r\n<li class="twitter"><a href="http://twitter.com/"></a></li>\r\n<li class="facebook"><a href="https://www.facebook.com/"></a></li>\r\n<li class="linkedin"><a href="http://www.linkedin.com/"></a></li>\r\n<li class="rss"><a href="https://drupal.org/node/feed"></a></li>\r\n</ul>', 'Connect with Us', 'full_html'),
(7, '<h2 class="block-title">To know more about <span class="drupal-logo-image">Drupal</span>:</h2>\r\n<ul><li><strong><a href="http://drupal.org" title="Drupal.org" target="_blank">Drupal.org</a></strong><br>Modules, themes, and community</li>\r\n<li><strong><a href="http://www.drupalshowcase.com/" title="Drupal Showcase">Drupal Showcase</a></strong><br>Collection of top Drupal sites</li>\r\n<li><strong><a href="http://planetdrupal.com" title="Planet Drupal" target="_blank">Planet Drupal</a></strong><br>Drupal news, constantly updated</li>\r\n</ul>', 'more about drupal', 'full_html');
