INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'blog', 0, 1, 1, 'und', 0, '<div><p>Free Software is not just about saving money.  It''s not just about sharing for sharing''s sake.  Free Software, at its core, is about empowering people.  It is about ensuring that everyone has ultimate control over their own electronic lives, because the software that runs their electronic lives is under their control and not someone else''s.</p>\r\n<p>How do you know your computer is doing what you tell it to, and not someone else?  How do you know your phone is only recording what you tell it to record?  How do you know your files are only being read by you?  How do you know your refrigerator isn''t reporting on your diet to someone else?</p>\r\n<p>The only way to be sure is to have the source code so that you or someone you trust can verify that it is doing only what you tell it to and your electronic tools are not secretly acting for someone else.  Free Software is all about ensuring an individual''s personal digital sovereignty, free from unwanted or secret invasion from anyone -- other people, corporations, or governments.</p>\r\n<p>The entire point of sharing source code is so that individual people and organizations can ultimately have control over their own equipment, information, and digital lives. In many ways it is about privacy: The security to know that your data is accessible to you, and your computer is used by you, and only you, unless you decide otherwise.</p>\r\n<p>Recent revelations, however, have shown that people''s digital sovereignty is under even more attack than before.  Both the American and British governments have been found violating the digital privacy of millions of people in their own countries and around the world.  That is exactly the sort of attack on individual digital sovereignty that Free Software was created to combat.</p>\r\n<p>As a leading Free Software project, the Drupal Community opposes such privacy invasions.  We believe it is our ethical duty to stand with <a href="https://thedaywefightback.org/" rel="nofollow">The Day We Fight Back</a> and others who oppose such violations of individual digital sovereignty.  We encourage all people, all over the world, to take a stand for digital freedom.  If you are in the United States you can use the banner at the bottom of this page to locate and contact your Congressional representatives and tell them to oppose further infringement of individual privacy rights and to force the NSA and similar agencies to obey the law in both letter and spirit.</p>\r\n</div>', '', 'full_html'),
('node', 'blog', 0, 2, 2, 'und', 0, '<div><p>You may have heard that a vulnerability in the OpenSSL cryptographic library called Heartbleed or formally called CVE-2014-0160 has been disclosed and that it represents a potential security threat to a large number of websites. Using this vulnerability, malicious individuals could access sensitive information submitted by people actively visiting a website including usernames, passwords and credit card numbers. Users across the Internet should be especially aware of suspicious activity on their accounts.</p>\r\n<p>We want to communicate a couple pieces of information about this news with regard to Drupal.org. </p>\r\n<p>Members of the Drupal Association staff, Drupal Security Team and Drupal Infrastructure Team have reviewed Drupal.org''s potential exposure to the vulnerability. </p>\r\n<p>As of now, we have no indication that Drupal.org was attacked using this vulnerabililty. That said, the nature of the vulnerability makes an attack difficult to detect and we prefer to be cautious. </p>\r\n<p>We have taken steps to protect users of Drupal.org, including a forced password reset for users with administrative access or access to code repositories for projects. While we have only forced the password reset for some users, we recommend that all of our users change their passwords.</p>\r\n<p>We have taken the following steps to protect Drupal.org account holders:</p>\r\n<ul><li>Installed new SSL certificates based on a new private key</li>\r\n<li>Revoked the old SSL certificates</li>\r\n<li>Replaced the private strings (drupal_private_key and drupal_hash_salt) which are used for a variety of security related purposes in all Drupal sites</li>\r\n<li>Replaced the private key used by the “bakery” single-sign-on system on Drupal.org</li>\r\n<li>Removed all active sessions</li>\r\n<li>Verified the email addresses in use today match those in use a week ago</li>\r\n<li><strong>Required that all Drupal.org users with administrative or project repository access to reset their passwords</strong></li>\r\n</ul><p>Also, we simply want to help create awareness about the vulnerability and encourage people to review their sites for exposure. For more information, please see <a href="https://web.nvd.nist.gov/view/vuln/detail?vulnId=CVE-2014-0160">https://web.nvd.nist.gov/view/vuln/detail?vulnId=CVE-2014-0160</a></p>\r\n<p>Feel free to comment on the post with any questions. Thank you!</p>\r\n</div>', '', 'filtered_html'),
('node', 'page', 0, 4, 4, 'und', 0, '<div style="border-bottom:1px solid #d9d9d9; padding:0 0 20px 0;">Drupal is an open source content management platform powering millions of websites and applications. It’s built, used, and supported by an active and diverse community of people around the world.\r\n<p>\r\n<div>\r\n<strong>Technical Requirements</strong>\r\n<p>For Drupal 7, you need the following to get started:</p>\r\n<ul><li><strong>Web Server</strong>: Apache or Microsoft IIS</li>\r\n<li><strong>PHP</strong>: 5.2 or higher</li>\r\n<li><strong>Database Server</strong>: MySQL - 5.0 or higher, PostgreSQL - 8.3 or higher, or SQLite</li>\r\n</ul><p>Drupal is web-based, which means it is compatible with all operating systems.</p>\r\n<p>More detailed information on the <a href="http://drupal.org/requirements">system requirements</a>.</p>\r\n</div>\r\n</p>\r\n</div>\r\n \r\n<div style="border-bottom:1px solid #d9d9d9; padding:0 0 20px 0;">\r\n<h2>Drupal Global Training Days</h2>\r\nDrupal Global Training Days is an initiative by the Drupal Association to introduce new and beginning users to Drupal. The Drupal Association is partnering with training companies to make this happen. Once a quarter, free or low cost training events will take place around the world with one of two curriculums:\r\n<ul><li>"Introduction to Drupal," a full day training on the basics of Drupal. Attendees will leave having successfully built a Drupal site. It is ideal for those interested in exploring Drupal as a career path.</li>\r\n<li>"What is Drupal?" This half-day workshop will address the basics of Drupal, and will give an overview to those interested in evaluating or implementing Drupal.  </li>\r\n</ul>\r\n<p>Each training company can make it their own event and provide more detail on their web pages.</p>\r\n<p>We invite you to come Learn Drupal!</p>\r\n<p>For upcoming Drupal Global Training Days see: <a href="http://drupal.org/learn-drupal">http://drupal.org/learn-drupal</a></p>\r\n</div>', '', 'full_html'),
('node', 'page', 0, 5, 5, 'und', 0, '<div class="aboutsmall">\r\n<p>From local businesses to global corporations, diverse organizations use Drupal.</p>\r\n<dl><dt>News Publishing</dt>\r\n<dd><a href="http://drupal.org/node/47792">NowPublic</a>, <a href="/popular-science">Popular Science</a>, Economist</dd>\r\n<dt>Intranet/Corporate Websites</dt>\r\n<dd><a href="http://drupal.org/node/217684">AOL Corporate</a>, <a href="/Dahon-Folding-Bicycles">Dahon Bicycles</a></dd>\r\n<dt>Education</dt>\r\n<dd><a href="http://drupal.org/node/182486">San Jose State University</a>, Harvard, MIT, <a href="/node/20436">Council on Writing Program Administrators</a></dd>\r\n<dt>Art, Music, Multimedia</dt>\r\n<dd><a href="http://drupal.org/node/81898">MTV UK</a>, <a href="/node/241344">Sony Music</a>, <a href="/node/162162">Warner Brothers Records</a></dd>\r\n<dt>Community Portal Sites</dt>\r\n<dd><a href="http://drupal.org/node/221481">Fast Company</a>, <a href="/node/72088">Team Sugar</a>, <a href="/node/228222">Ubuntu Brainstorm</a></dd>\r\n<dt>Social Networking Sites</dt>\r\n<dd><a href="http://drupal.org/node/288476">DrupalSN</a></dd>\r\n</dl><p>More examples can be found in <a href="/cases">Sites Made with Drupal</a>.</p>\r\n</div>', '', 'filtered_html'),
('node', 'page', 0, 6, 6, 'und', 0, '<div>\r\n<div class="service-left grid_6 alpha">\r\n<dl><dt><a href="/search/apachesolr_search">Search</a></dt>\r\n<dd>Search the site first to see if your question has already been asked and answered.</dd>\r\n<dt><a href="/forum">Forums</a></dt>\r\n<dd>Post to ask questions, or answer questions posted by other Drupal community members.</dd>\r\n<dt><a href="/documentation">Community Documentation</a></dt>\r\n<dd>Read the Drupal.org online documentation, which is written and maintained by the Drupal community.</dd>\r\n<dt><a href="/irc">IRC online chat</a></dt>\r\n<dd>Chat with the Drupal community to get fast, effective support.</dd>\r\n<dt>Drupal Core Issue Queue</dt>\r\n<dd>To get support for a core bug, see the <a href="http://drupal.org/project/issues/drupal">core issue queue</a>, but be sure to search for any relevant existing issues before creating a new one.</dd>\r\n<dt>Project Issue Queues</dt>\r\n<dd>To get support with a specific project on Drupal.org, find the <a href="http://drupal.org/project/modules">module</a>, <a href="http://drupal.org/project/themes">theme</a>, or <a href="http://drupal.org/project/distributions">distribution</a>, search the project''s issue queue, and either follow the relevant issue or create a new issue if you don''t find one.</dd>\r\n<dt><a href="/language-specific-communities">Other languages</a></dt>\r\n<dd>Find a language-specific community for a non-English language, and learn how to <a href="/localize">install Drupal in your language</a>.</dd>\r\n<dt><a href="/books">Books</a></dt>\r\n<dd>Find books about Drupal.</dd>\r\n<dt><a href="/drupal-services">Professional services</a></dt>\r\n<dd>Locate individuals and organizations providing Drupal-related professional services including installation, design, <a href="/hosting">hosting</a>, module development, site building, and support.</dd>\r\n<dt><a href="/training">Drupal training</a></dt>\r\n<dd>Find organizations that provide Drupal training services.</dd>\r\n</dl>\r\n<h3>Head straight to <a href="http://drupal.org">drupal.org</a> and search before asking others, coz there is document out there for everything</h3>\r\n</div>\r\n</div>\r\n ', '', 'full_html'),
('node', 'page', 0, 9, 10, 'und', 0, '<div class="region-inner region-content-inner">\r\n    <a id="main-content"></a>\r\n            <div data-personalize-entity-id="block/delta_blocks-messages" class="block block-delta-blocks block-messages block-delta-blocks-messages odd block-without-title" id="block-delta-blocks-messages">\r\n  <div class="inner clearfix">\r\n                \r\n    <div class="content clearfix">\r\n          </div>\r\n  </div>\r\n</div>\r\n<div data-personalize-entity-id="block/4496" class="block block-delta-blocks block-breadcrumb block-delta-blocks-breadcrumb even block-without-title" id="block-delta-blocks-breadcrumb">\r\n  <div class="inner clearfix">\r\n                \r\n    <div class="content clearfix">\r\n      <a href="/">Home</a> / <a href="/resources" id="menu-resources">Resources</a> / What is Drupal?    </div>\r\n  </div>\r\n</div>\r\n<div data-personalize-entity-id="block/4491" class="block block-delta-blocks block-page-title block-delta-blocks-page-title odd block-without-title" id="block-delta-blocks-page-title">\r\n  <div class="inner clearfix">\r\n                \r\n    <div class="content clearfix">\r\n      <h1 id="page-title" class="title">What is Drupal?</h1>    </div>\r\n  </div>\r\n</div>\r\n<div data-personalize-entity-id="block/1039" class="block block-system block-main block-system-main even block-without-title" id="block-system-main">\r\n  <div class="inner clearfix">\r\n                \r\n    <div class="content clearfix">\r\n      <div about="/what-is-drupal" typeof="sioc:Item foaf:Document" class="node node-landing-page node-published node-not-promoted node-not-sticky author-acquia-admin odd clearfix" id="node-landing-page-2014673">\r\n    \r\n    \r\n    \r\n  \r\n  <div class="content clearfix">\r\n    \r\n<div class="field field-name-body field-type-text-with-summary field-label-hidden">\r\n    <div class="field-items">\r\n          <div property="content:encoded" class="field-item even"><h2>Information on Drupal</h2>\r\n<div class="what-is-drupal-landing">\r\n<div class="intro-text"><span class="drupal-logo">Drupal</span> is a free, open-source web development platform for online content and user communities. Drupal powers some of the busiest sites on the web, and can be adapted to virtually any visual design. Drupal runs over a million sites, including WhiteHouse.gov, World Economic Forum, Stanford University, and Examiner.com.</div>\r\n<div class="content-block" id="one">\r\n<div class="left">\r\n&nbsp;</div>\r\n<div class="right">\r\n<h3><span class="drupal-logo">Drupal</span> is open</h3>\r\n<p>Drupal was created over ten years ago and released as open-source software under the GNU Public License. That means it’s completely free to download, use, and modify: There are no purchase, license, or maintenance fees.</p>\r\n</div>\r\n<div class="clear"></div>\r\n</div>\r\n<!-------------------------------------><div class="content-block" id="two">\r\n<div class="left">\r\n&nbsp;</div>\r\n<div class="right">\r\n<h3><span class="drupal-logo">Drupal</span> is web development</h3>\r\n<p>Drupal’s default installation is a database-backed web platform with file maintenance tools and a high level of security. Many developers take advantage of Drupal’s extensible architecture to go far beyond the “core” package.</p>\r\n</div>\r\n<div class="clear"></div>\r\n</div>\r\n<!-------------------------------------><div class="content-block" id="three">\r\n<div class="left">\r\n&nbsp;</div>\r\n<div class="right">\r\n<h3><span class="drupal-logo">Drupal</span> is social</h3>\r\n<p>Drupal is a multi-user system, letting site visitors log in (as “authenticated” users) or browse the site without doing so (as “anonymous” users). You control their access levels, and can also assign “roles” for multiple permission levels.</p>\r\n</div>\r\n<div class="clear"></div>\r\n</div>\r\n<!-------------------------------------><div class="content-block" id="four">\r\n<div class="left">\r\n&nbsp;</div>\r\n<div class="right">\r\n<h3><span class="drupal-logo">Drupal</span> is content</h3>\r\n<p>Drupal both hosts and promotes your content. It can reach out beyond your site to give you a presence on Twitter, Facebook, and in other venues. Drupal’s built-in features also give search engines what they want, improving your web impact automatically.</p>\r\n</div>\r\n<div class="clear"></div>\r\n</div>\r\n<!-------------------------------------><div class="content-block" id="five">\r\n<div class="left">\r\n&nbsp;</div>\r\n<div class="right">\r\n<h3><span class="drupal-logo">Drupal</span> is scalable</h3>\r\n<p>Drupal has proven itself repeatedly in the field on sites with over a million pages, and at over 20,000 requests per second. Its core installation handles over 99 percent of use cases, while free optimization tools and a large base of Drupal-trained administrators address the other one percent.</p>\r\n</div>\r\n<div class="clear"></div>\r\n</div>\r\n<!-------------------------------------><div class="content-block" id="six">\r\n<div class="left">\r\n&nbsp;</div>\r\n<div class="right">\r\n<h3><span class="drupal-logo">Drupal</span> is design</h3>\r\n<p>Drupal site designs come from “themes”, whose visual presentation is described in standard CSS. Drupal.org hosts hundreds of free, fully customizable themes, including several “base themes” to help you launch your own designs.</p>\r\n</div>\r\n<div class="clear"></div>\r\n</div>\r\n<!-------------------------------------><div class="content-block" id="seven">\r\n<div class="left">\r\n&nbsp;</div>\r\n<div class="right">\r\n<h3><span class="drupal-logo">Drupal</span> is everywhere</h3>\r\n<p>Drupal runs millions of web sites, including many of the world’s biggest. It’s especially strong among major governments and industry-leading enterprises, but is easy enough to be the platform of choice for individuals and small companies.</p>\r\n</div>\r\n<div class="clear"></div>\r\n</div>\r\n<!-------------------------------------><div class="content-block" id="eight">\r\n<div class="left">\r\n&nbsp;</div>\r\n<div class="right">\r\n<h3><span class="drupal-logo">Drupal</span> is secure</h3>\r\n<p>Drupal is used by thousands of high profile web sites and is subject to rigorous security testing both by the Drupal community and by security experts around the world.    Drupal''s core code has been proven to prevent common security vulnerabilities such as those defined by the Open Web Application Security Project (OWASP).</p>\r\n</div>\r\n<div class="clear"></div>\r\n</div>\r\n</div>\r\n</div>\r\n      </div>\r\n</div>\r\n<span property="dc:title" content="What is Drupal?" class="rdf-meta"></span>  </div>\r\n  \r\n  <div class="clearfix">\r\n          <div class="links"></div>\r\n    \r\n      </div>\r\n</div>\r\n    </div>\r\n  </div>\r\n</div>\r\n  </div>', '', 'full_html'),
('node', 'page', 0, 10, 11, 'und', 0, '<div><p><strong>Drupal.org website</strong> (as well as the Drupal project and the community) is run primarily by volunteers.</p>\r\n<p>It''s built with Drupal 7 and has many customizations in code. There are many <a href="https://drupal.org/project/drupal.org%20projects?filters=bs_project_sandbox%3A%5B%2A%20TO%20%2A%5D" rel="nofollow">Drupal.org-specific projects</a> that are used to organize improvements and code.</p>\r\n<h2>Who are the maintainers?</h2>\r\n<ul><li><a href="https://drupal.org/node/1206660" rel="nofollow">Drupal.org infrastructure team leaders (org chart)</a></li>\r\n<li><a href="https://drupal.org/site-maintainers" rel="nofollow">List of Drupal.org webmasters</a></li>\r\n<li>The Drupal community as a whole maintains the content on Drupal.org</li>\r\n</ul><h2>How can I contribute?</h2>\r\n<p>Everyone can (and should) contribute to maintaining Drupal.org. If you are interested - take a look at the <a href="https://drupal.org/contribute/drupalorg" rel="nofollow">Contribute to Drupal.org guide</a> and <a href="https://drupal.org/community-initiatives/drupalorg" rel="nofollow">Drupal.org community initiatives page</a>.</p>\r\n<h2>Drupal.org sub-sites</h2>\r\n<ul><li><a href="https://api.drupal.org" rel="nofollow">Api.drupal.org</a>- Drupal developer''s documentation</li>\r\n<li><a href="https://association.drupal.org" rel="nofollow">Drupal Association</a> -  an educational non-profit organization that tasks itself with fostering and supporting the Drupal software project, the community and its growth.</li>\r\n<li><a href="https://groups.drupal.org" rel="nofollow">Drupal Groups</a> - a place for groups to organize, plan and work on projects.</li>\r\n<li><a href="https://localize.drupal.org" rel="nofollow">Drupal Translations</a> - server used by translators from around the world to maintain localizations of all projects on drupal.org.</li>\r\n<li><a href="http://drupalcode.org/" rel="nofollow">DrupalCode.org</a> - Gitweb interface for Drupal.org projects</li>\r\n<li><a href="https://qa.drupal.org/" rel="nofollow">Drupal Testbot</a></li>\r\n<li><a href="https://security.drupal.org" rel="nofollow">Drupal Security team</a> - private website</li>\r\n<li><a href="https://infrastructure.drupal.org/" rel="nofollow">Drupal Infrastructure team</a> - private website</li>\r\n</ul><h3>Other sites hosted on Drupal.org</h3>\r\n<ul><li>DrupalCon websites: <a href="https://drupal.org/drupalcon">https://drupal.org/drupalcon</a></li>\r\n<li>Archived DrupalCamp sites: <a href="https://drupal.org/camp-archive">https://drupal.org/camp-archive</a></li>\r\n</ul><p></p>\r\n</div>', '', 'filtered_html'),
('node', 'page', 0, 11, 12, 'und', 0, '<div align="center"><h2>Uh oh, you aren''t welcomed here :(</h2>\r\n<p>Access denied. You aren''t authorized to access this page.</p>\r\n<img src="sites/default/files/access-403.png">\r\n</div>', '', 'full_html'),
('node', 'page', 0, 12, 13, 'und', 0, '<div align="center"><h2>Error !!</h2>\r\n<p>Oops, you have reached a non existing page!!!.</p>\r\n<img src="sites/default/files/access-404.png">\r\n</div>', '', 'full_html'),
('node', 'blog', 0, 13, 14, 'und', 0, '<div><p><center><img src="/sites/default/files/druplicon.small_.png" alt="PNG version" class="left"></center><br>After Drupal was initially developed, thoughts turned to the creation of a logo. Of course the concept would have to include a drop, or water in general.</p>\r\n<p>The initial idea was simple: a drop within a circle. It was conceived as an "O" in a fluid "drop".</p>\r\n<p>Somewhat later there was an idea to use a cartoon-like drop with a face. Steven Wittens (UnConeD) created a 3D version, but the idea didn''t get too far, mainly because 3D is difficult to work with. </p>\r\n<p>When the logo issue came up again, Kristjan Jansen (Kika) came up with the idea of putting two sideways drops together to form an infinity symbol. When placed inside a filled circle, it resembled a face. After more work by Steven Wittens, the Druplicon was created: a stylised drop with the "infinity" eyes, a round nose and a mischievous smile.</p>\r\n<p>You can find more versions of the logo in the <a href="http://drupal.org/node/9068" rel="nofollow">marketing section</a>.</p>\r\n</div>', '', 'full_html');
