INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' joining the day we fight back admin s blog free software is not just about saving money it s not just about sharing for sharing s sake free software at its core is about empowering people it is about ensuring that everyone has ultimate control over their own electronic lives because the software that runs their electronic lives is under their control and not someone else s how do you know your computer is doing what you tell it to and not someone else how do you know your phone is only recording what you tell it to record how do you know your files are only being read by you how do you know your refrigerator isn t reporting on your diet to someone else the only way to be sure is to have the source code so that you or someone you trust can verify that it is doing only what you tell it to and your electronic tools are not secretly acting for someone else free software is all about ensuring an individual s personal digital sovereignty free from unwanted or secret invasion from anyone other people corporations or governments the entire point of sharing source code is so that individual people and organizations can ultimately have control over their own equipment information and digital lives in many ways it is about privacy the security to know that your data is accessible to you and your computer is used by you and only you unless you decide otherwise recent revelations however have shown that people s digital sovereignty is under even more attack than before both the american and british governments have been found violating the digital privacy of millions of people in their own countries and around the world that is exactly the sort of attack on individual digital sovereignty that free software was created to combat as a leading free software project the drupal community opposes such privacy invasions we believe it is our ethical duty to stand with the day we fight back and others who oppose such violations of individual digital sovereignty we encourage all people all over the world to take a stand for digital freedom if you are in the united states you can use the banner at the bottom of this page to locate and contact your congressional representatives and tell them to oppose further infringement of individual privacy rights and to force the nsa and similar agencies to obey the law in both letter and spirit we encourage all people all permalink submitted by admin on thu 5222014 1712 we encourage all people all over the world to take a stand for digital freedom and use linux கோபிநாத் log in to post comments  ', 1400772660),
(2, 'node', ' drupalorg response to heartbleed security incident admin s blog you may have heard that a vulnerability in the openssl cryptographic library called heartbleed or formally called cve20140160 has been disclosed and that it represents a potential security threat to a large number of websites using this vulnerability malicious individuals could access sensitive information submitted by people actively visiting a website including usernames passwords and credit card numbers users across the internet should be especially aware of suspicious activity on their accounts we want to communicate a couple pieces of information about this news with regard to drupalorg members of the drupal association staff drupal security team and drupal infrastructure team have reviewed drupalorg s potential exposure to the vulnerability as of now we have no indication that drupalorg was attacked using this vulnerabililty that said the nature of the vulnerability makes an attack difficult to detect and we prefer to be cautious we have taken steps to protect users of drupalorg including a forced password reset for users with administrative access or access to code repositories for projects while we have only forced the password reset for some users we recommend that all of our users change their passwords we have taken the following steps to protect drupalorg account holders installed new ssl certificates based on a new private key revoked the old ssl certificates replaced the private strings drupalprivatekey and drupalhashsalt which are used for a variety of security related purposes in all drupal sites replaced the private key used by the bakery singlesignon system on drupalorg removed all active sessions verified the email addresses in use today match those in use a week ago required that all drupalorg users with administrative or project repository access to reset their passwords also we simply want to help create awareness about the vulnerability and encourage people to review their sites for exposure for more information please see https webnvdnistgov view vuln detail vulnid cve20140160 feel free to comment on the post with any questions thank you  removing all active sessions permalink submitted by admin on sat 11102012 1246 i searched around a bunch today to try and figure out the quickest easiest way to remove all active sessions but couldn t find anything i want to do this for my site i ve replaced my ssl cert etc how do i do that  log in to post comments on drupal 6 permalink submitted by admin on thu 5222014 1702 i should mention that my site is still running d6 i know there s an active sessions module for d7 that i could install which would show me all active sessions and allow me to close them but is there a simple solution for a d6 site  log in to post comments  ', 1400772608),
(4, 'node', ' welcome to drupal drupal is an open source content management platform powering millions of websites and applications it s built used and supported by an active and diverse community of people around the world technical requirements for drupal 7 you need the following to get started  web server  apache or microsoft iis php  52 or higher database server  mysql 50 or higher postgresql 83 or higher or sqlite drupal is webbased which means it is compatible with all operating systems more detailed information on the system requirements  drupal global training days drupal global training days is an initiative by the drupal association to introduce new and beginning users to drupal the drupal association is partnering with training companies to make this happen once a quarter free or low cost training events will take place around the world with one of two curriculums introduction to drupal a full day training on the basics of drupal attendees will leave having successfully built a drupal site it is ideal for those interested in exploring drupal as a career path what is drupal this halfday workshop will address the basics of drupal and will give an overview to those interested in evaluating or implementing drupal each training company can make it their own event and provide more detail on their web pages we invite you to come learn drupal for upcoming drupal global training days see  http drupalorg learndrupal ', 0),
(5, 'node', ' who s using drupal from local businesses to global corporations diverse organizations use drupal news publishing nowpublic   popular science  economist intranet corporate websites aol corporate   dahon bicycles education san jose state university  harvard mit  council on writing program administrators art music multimedia mtv uk   sony music   warner brothers records community portal sites fast company   team sugar   ubuntu brainstorm social networking sites drupalsn more examples can be found in sites made with drupal   ', 0),
(6, 'node', ' get help  search search the site first to see if your question has already been asked and answered forums post to ask questions or answer questions posted by other drupal community members community documentation read the drupalorg online documentation which is written and maintained by the drupal community irc online chat chat with the drupal community to get fast effective support drupal core issue queue to get support for a core bug see the core issue queue  but be sure to search for any relevant existing issues before creating a new one project issue queues to get support with a specific project on drupalorg find the module   theme  or distribution  search the project s issue queue and either follow the relevant issue or create a new issue if you don t find one other languages find a languagespecific community for a nonenglish language and learn how to install drupal in your language  books find books about drupal professional services locate individuals and organizations providing drupalrelated professional services including installation design  hosting  module development site building and support drupal training find organizations that provide drupal training services head straight to drupalorg and search before asking others coz there is document available for everything ', 1400772237),
(8, 'node', ' what s your favorite cms  drupal 42 1029 votes wordpress 40 1001 votes joomla 16 400 votes typo3 2 43 votes total votes 2473  ', 1400772261),
(9, 'node', ' what is drupal  home   resources  what is drupal  what is drupal  information on drupal drupal is a free opensource web development platform for online content and user communities drupal powers some of the busiest sites on the web and can be adapted to virtually any visual design drupal runs over a million sites including whitehousegov world economic forum stanford university and examinercom  drupal is open drupal was created over ten years ago and released as opensource software under the gnu public license that means it s completely free to download use and modify there are no purchase license or maintenance fees  drupal is web development drupal s default installation is a databasebacked web platform with file maintenance tools and a high level of security many developers take advantage of drupal s extensible architecture to go far beyond the core package  drupal is social drupal is a multiuser system letting site visitors log in as authenticated users or browse the site without doing so as anonymous users you control their access levels and can also assign roles for multiple permission levels  drupal is content drupal both hosts and promotes your content it can reach out beyond your site to give you a presence on twitter facebook and in other venues drupal s builtin features also give search engines what they want improving your web impact automatically  drupal is scalable drupal has proven itself repeatedly in the field on sites with over a million pages and at over 20000 requests per second its core installation handles over 99 percent of use cases while free optimization tools and a large base of drupaltrained administrators address the other one percent  drupal is design drupal site designs come from themes whose visual presentation is described in standard css drupalorg hosts hundreds of free fully customizable themes including several base themes to help you launch your own designs  drupal is everywhere drupal runs millions of web sites including many of the world s biggest it s especially strong among major governments and industryleading enterprises but is easy enough to be the platform of choice for individuals and small companies  drupal is secure drupal is used by thousands of high profile web sites and is subject to rigorous security testing both by the drupal community and by security experts around the world drupal s core code has been proven to prevent common security vulnerabilities such as those defined by the open web application security project owasp  ', 0),
(10, 'node', ' about drupalorg drupalorg website  as well as the drupal project and the community is run primarily by volunteers it s built with drupal 7 and has many customizations in code there are many drupalorgspecific projects that are used to organize improvements and code who are the maintainers  drupalorg infrastructure team leaders org chart  list of drupalorg webmasters the drupal community as a whole maintains the content on drupalorg how can i contribute everyone can and should contribute to maintaining drupalorg if you are interested take a look at the contribute to drupalorg guide and drupalorg community initiatives page  drupalorg subsites apidrupalorg  drupal developer s documentation drupal association  an educational nonprofit organization that tasks itself with fostering and supporting the drupal software project the community and its growth drupal groups  a place for groups to organize plan and work on projects drupal translations  server used by translators from around the world to maintain localizations of all projects on drupalorg drupalcodeorg  gitweb interface for drupalorg projects drupal testbot drupal security team  private website drupal infrastructure team  private website other sites hosted on drupalorg drupalcon websites  https drupalorg drupalcon archived drupalcamp sites  https drupalorg camparchive ', 0),
(11, 'node', ' access denied uh oh you aren t welcomed here  access denied you aren t authorized to access this page  ', 0),
(12, 'node', ' page not found error  oops you have reached a non existing page  ', 0);
